(1, 'EBOOKASYON', 'EbookasyonOfficial@gmail.com', '123123', 'DORAEMON.jpg', '09302955637', '221B Baker St.', '2020-11-03 10:33:35.170257', '2021-01-21 14:17:00.646000');
INSERT INTO `books_table` (`BOOK_ID`, `BOOK_TITLE`, `BOOK_AUTHOR`, `BOOK_COVER`, `BOOK_FILE`, `BOOK_PRICE`, `BOOK_DESC`, `BOOK_CATEGORY`, `BOOK_CREATED_DATE`, `BOOK_MODIFIED_DATE`) VALUES
(1, 'Approaches to sustainable agriculture: Exploring the pathways towards the future of farming', 'Barbara Pia Oberc and Alberto Arroyo Schnell', 'Approaches to sustainable agriculture Exploring the pathways towards the future of farming.PNG', 0x417070726f616368657320746f207375737461696e61626c65206167726963756c74757265204578706c6f72696e672074686520706174687761797320746f77617264732074686520667574757265206f66206661726d696e672e706466, '3446.74', 'The high amount of land used for cultivation and livestock farming has dramatically shaped landscapes in Europe and throughout the rest of the world. Agriculture is a fundamental human activity that intrinsically depends on nature and at the same time poses a threat to it. Thus, sustainability has emerged as a necessity in future agricultural policy and practice. Sustainable agriculture will need first and foremost to consider two inseparable, intertwined societal priorities – preserving the environment and providing safe and healthy food for all. It will be necessary for all sectors and stakeholders involved in the food system and nature conservation to find a common path for the future which embraces these two priorities.', 'Agriculture, Aquaculture, and Food Service', '2021-06-03 19:15:16.791000', '2021-06-03 19:15:16.791000'),
(2, 'Aquaculture Junior Farmer Field and Life School - Facilitator’s guide', 'Food and Agriculture Organization of the United Nations', 'Aquaculture Junior Farmer Field and Life School - Facilitator’s guide.PNG', 0x4171756163756c74757265204a756e696f72204661726d6572204669656c6420616e64204c696665205363686f6f6c202d20466163696c697461746f72e28099732067756964652e706466, '350.00', 'This guide provides insight into the critical role of aquaculture for food security. It provides details on the various types of aquaculture, the value of aquaculture as a means of livelihood diversification and business opportunities and the importance of careful planning. The module intends to provide flexible guidance to facilitators that can be adapted according to specific socio-economic and cultural contexts and the needs of each target group and country where it is used. This is a Junior Farm Field and Life Schools (JFFLS) module and complements other JFFLS modules, in particular Capture fisheries and Postharvest to produce enhanced economic opportunities.', 'Agriculture, Aquaculture, and Food Service', '2021-06-03 19:23:14.127000', '2021-06-03 19:23:14.127000'),
(3, 'Farmer’s Handbook on Basic Agriculture', 'National Institute of Agricultural Extension, Ministry of Agriculture, India', 'Farmer’s Handbook on Basic Agriculture.PNG', 0x4661726d6572e28099732048616e64626f6f6b206f6e204261736963204167726963756c747572652e706466, '955.55', 'We trust that this Handbook will benefit maximum number of farmers to make farming economically and environmentally more sustainable. The book contains six chapters, each focusing on a particular topic. Topics covered includes: General Conditions for Cultivation of Crops, Farm Management, Occupational Health and Safety, Farmer''s Access to Service.', 'Agriculture, Aquaculture, and Food Service', '2021-06-03 19:26:02.521000', '2021-06-03 19:26:02.521000'),
(4, 'The Science of Poultry and Meat Processing', 'Dr. Shai Barbut', 'The Science of Poultry and Meat Processing.jpg', 0x54686520536369656e6365206f6620506f756c74727920616e64204d6561742050726f63657373696e672e706466, '3160.32', 'The Science of Poultry and Meat Processing is a book which provides students and industry personnel with a comprehensive overview of the modernized meat industry.', 'Agriculture, Aquaculture, and Food Service', '2021-06-03 19:27:13.201000', '2021-06-03 19:27:13.201000'),
(5, 'Toward a Sustainable Agriculture: Farming Practices and Water Use', 'Max Bergman and Henry Jordan', 'Toward a Sustainable Agriculture Farming Practices and Water Use.PNG', 0x546f776172642061205375737461696e61626c65204167726963756c74757265204661726d696e672050726163746963657320616e64205761746572205573652e706466, '2838.30', 'The authors explore risks and potential solutions to inform producers and policy makers regarding practices towards sustainable production, and regarding the sustainable use of freshwater in agricultural production in a context of a changing climate.', 'Agriculture, Aquaculture, and Food Service', '2021-06-03 20:40:43.313000', '2021-06-03 20:40:43.313000'),
(6, 'Architectural Design and Construction - Instructor''s Manual', 'Michael Behm, Ph.D. and Cory Boughton', 'Architectural Design and Construction - Instructor''s Manual.PNG', 0x4172636869746563747572616c2044657369676e20616e6420436f6e737472756374696f6e202d20496e7374727563746f722773204d616e75616c2e706466, '650.57', 'This Instructor’s Manual is part of a broad-based multi-stakeholder initiative, Prevention through Design (PtD). This module has been developed for use by educators to disseminate the PtD concept and practice within the undergraduate engineering curricula. Prevention through Design anticipates and minimizes occupational safety and health hazards and risks at the design phase of products, considering workers through the entire life cycle, from the construction workers to the users, the maintenance staff, and, finally, the demolition team. The engineering profession has long recognized the importance of preventing occupational safety and health problems by designing out hazards. Industry leaders want to reduce costs by preventing negative safety and health consequences of poor designs. Thus, owners, designers, and trade contractors all have an interest in the final design.', 'Architecture and Planning', '2021-06-03 20:42:04.446000', '2021-06-03 20:42:04.446000'),
(7, 'Architecture: Form, Space, and Order', 'Francis D. K. Ching', 'Architecture Form, Space, and Order.PNG', 0x41726368697465637475726520466f726d2c2053706163652c20616e64204f726465722e706466, '4744.08', 'For more than thirty years, the beautifully illustrated Architecture: Form, Space, and Order has been the classic introduction to the basic vocabulary of architectural design. The updated Third Edition features expanded sections on circulation, light, views, and site context, along with new considerations of environmental factors, building codes, and contemporary examples of form, space, and order.', 'Architecture and Planning', '2021-06-03 20:42:55.519000', '2021-06-03 20:42:55.519000'),
(8, 'Autodesk Revit Architecture 2014: No Experience Required', 'Eric Wing', 'Autodesk Revit Architecture 2014.jpg', 0x4175746f6465736b2052657669742041726368697465637475726520323031342e706466, '2433.38', 'This Autodesk Official Press book helps you become proficient with Autodesk''s popular building information modeling software using an innovative continuous tutorial. It covers each phase of designing, documenting, and presenting a four-story office building, a real-world project you might expect to encounter on the job. Concise explanations, focused examples, step-by-step instructions, and an engaging hands-on tutorial make this Autodesk Official Press guide the perfect way to learn Revit Architecture.', 'Architecture and Planning', '2021-06-03 20:43:58.886000', '2021-06-03 20:43:58.886000'),
(9, 'Buildings Across Time: An Introduction to World Architecture', 'Michael Fazio, Marian Moffett, and Lawrence Wodehouse', 'Buildings Across Time An Introduction to World Architecture.PNG', 0x4275696c64696e6773204163726f73732054696d6520416e20496e74726f64756374696f6e20746f20576f726c64204172636869746563747572652e706466, '1845.88', 'Buildings Across Time, Fifth Edition offers a survey of world architecture both for students taking introductory courses and for the general reader simply interested in buildings. The authors have searched out the stories these buildings tell, considered the intentions of the people who built them, and examined the lives of those who used them. The text begins with prehistory and ends with early Twenty-First Century. It covers the Western tradition as well as works in the Islamic world, the pre-Columbian Americas, Africa, China, Southeast Asia, Russia, and Japan.', 'Architecture and Planning', '2021-06-03 20:53:03.648000', '2021-06-03 20:53:03.648000'),
(10, 'Introduction to Architectural Science: The Basis of Sustainable Design', 'S. V. Szokolay', 'Introduction to Architectural Science The Basis of Sustainable Design.PNG', 0x496e74726f64756374696f6e20746f204172636869746563747572616c20536369656e636520546865204261736973206f66205375737461696e61626c652044657369676e2e706466, '3008.42', 'Introducing the basics of architectural science, this book is an ideal reference, providing an understanding of the physical basis of architectural design. The knowledge gained from this book equips the reader with the tools to realize the full potential of the good intentions of sustainable, bioclimatic design.', 'Architecture and Planning', '2021-06-03 20:54:17.021000', '2021-06-03 20:54:17.021000'),
(11, 'Modern Architecture: A Guidebook for His Students to this Field of Art', 'Otto Wagner', 'Modern Architecture A Guidebook for His Students to this Field of Art.PNG', 0x4d6f6465726e204172636869746563747572652041204775696465626f6f6b20666f72204869732053747564656e747320746f2074686973204669656c64206f66204172742e706466, '2875.20', 'Wagner''s historic manifesto is now presented in a new English translation - the first in almost ninety years - based on the expanded 1902 text and noting emendations made to the 1896, 1898, and 1914 editions. In his introduction, Dr. Harry Mallgrave examines Wagner''s tract against the backdrop of nineteenth-century theory, critically exploring the affinities of Wagner''s revolutionary élan with the German eclectic debate of the 1840s, the materialistic tendencies of the 1870s and 1880s, and the emerging cultural ideology of modernity. Modern Architecture is one of those rare works in the literature of architecture that not only proclaimed the dawning of a new era, but also perspicaciously and cogently shaped the issues and the course of its development; it defined less the personal aspirations of \r\none individual and more the collective hopes and dreams of a generation facing the sanguine promise of a new century.', 'Architecture and Planning', '2021-06-03 20:55:10.935000', '2021-06-03 20:55:10.935000'),
(12, 'The Art of Architectural Drawing: Imagination and Technique', 'Thomas Wells Schaller', 'The Art of Architectural Drawing.jpg', 0x54686520417274206f66204172636869746563747572616c2044726177696e672e706466, '5319.12', 'I find it highly engaging and very readable. Tom Schaller has amassed a wealth of material and references to engage the reader with aspects from history, perception and psychology, fine arts painting, architectural illustration, and on and on. This is a very inspirational work. It’s a winner! --Harold Linton. Assistant Dean, College of Architecture and Design, Lawrence Technological University If erudition, originality, energy and output could be claimed to constitute heat, then Tom Schaller is the hottest \r\nperspectives of the nineties.', 'Agriculture, Aquaculture, and Food Service', '2021-06-03 20:55:56.705000', '2021-06-03 20:55:56.705000'),
(13, 'Absolute Beginner''s Guide to Digital Photography', 'Barbara London, John Upton, Ken Kobre, Betsy Brill, Peter Kuhns, and Joseph Ciaglia', 'Absolute Beginner''s Guide to Digital Photography.PNG', 0x4162736f6c75746520426567696e6e6572277320477569646520746f204469676974616c2050686f746f6772617068792e706466, '427.45', 'Teaches basic digital photography techniques, including exposure, focus, lighting, file formats, file storage, the equipment and materials available, and how to use Adobe Photoshop Elements iPhoto to edit images.', 'Arts and Applied', '2021-06-03 20:57:36.354000', '2021-06-03 20:57:36.354000'),
(14, 'Historical Painting Techniques, Materials, and Studio Practice', 'Preprints of a Symposium, University of Leiden, the Netherlands', 'Historical Painting Techniques, Materials, and Studio Practice.PNG', 0x486973746f726963616c205061696e74696e6720546563686e69717565732c204d6174657269616c732c20616e642053747564696f2050726163746963652e706466, '4744.08', 'Bridging the fields of conservation, art history, and museum curating, this volume contains the principal papers from an international symposium titled "Historical Painting Techniques, Materials, and Studio Practice" at the University of Leiden in Amsterdam, Netherlands, from June 26 to 29, 1995. The symposium—designed for art historians, conservators, conservation scientists, and museum curators worldwide—was organized by the Department of Art History at the University of Leiden and the Art History Department of the Central Research Laboratory for Objects of Art and Science in Amsterdam.', 'Arts and Applied', '2021-06-03 20:59:33.051000', '2021-06-03 20:59:33.051000'),
(15, 'Mastering Photoshop for Web Designers Vol 2', 'Sven Lennartz, Vitaly Friedman, and Thomas Burkert', 'Mastering Photoshop for Web Designers Vol 2.PNG', 0x4d6173746572696e672050686f746f73686f7020666f72205765622044657369676e65727320566f6c20322e706466, '239.60', 'When it comes to designing in Photoshop, there is a myriad of ways one could use to achieve a certain result. Designers use techniques they are most confident as well as comfortable with, which is great because it’s always useful to peek into the workflow of our colleagues and learn new design approaches. Creating great artwork without intimately knowing your tools is certainly possible, but the more you know, the more likely you are to work faster and with greater confidence.', 'Arts and Applied', '2021-06-03 21:01:14.294000', '2021-06-03 21:01:14.294000'),
(16, 'The Origins of Music', 'Nils Lennart Wallin, Björn Merker, Steven Brown', 'The Origins of Music.PNG', 0x546865204f726967696e73206f66204d757369632e706466, '2475.55', 'The present volume is based on a workshop entitled “The Origins of Music” arranged by the Institute for Biomusicology in the Etruscan town of Fiesole outside Florence in late May 1997. As the workshop was the first international gathering held under the auspices of the Institute since its founding in 1995, a few words are in order concerning the Institute’s background.', 'Arts and Applied', '2021-06-03 21:02:16.795000', '2021-06-03 21:02:16.795000'),
(17, 'Understanding Music: Past and Present', 'Alan Clark, Thomas Heflin, Jeffery Kluball, and Elizabeth Kramer', 'Understanding Music Past and Present.PNG', 0x556e6465727374616e64696e67204d75736963205061737420616e642050726573656e742e706466, '1873.67', 'Understanding Music: Past and Present is an open Music Appreciation textbook co-authored by music faculty across Georgia. The text covers the fundamentals of music and the physics of sound, an exploration of music from the Middle Ages to the present day, and a final chapter on popular music in the United States.', 'Arts and Applied', '2021-06-03 21:03:00.623000', '2021-06-03 21:03:00.623000'),
(18, 'Global Business Strategy: A Systems Approach', 'A. Kefalas, A. Kefalas', 'Global Business Strategy A Systems Approach.PNG', 0x476c6f62616c20427573696e65737320537472617465677920412053797374656d7320417070726f6163682e706466, '1257.90', '"Global Business Strategy: A Systems Approach" is one of the free open textbooks for Tertiary level.  Feel free to use, adapt and modify the content to your own needs, and share the improved content with others because the book is offered under Creative Commons (CC) license. It allows users to repurpose the materials under the condition that original authors’ contribution is acknowledged.', 'Business, Economics, Finance, And Accounting', '2021-06-03 21:03:50.080000', '2021-06-03 21:03:50.080000'),
(19, 'Introducing Marketing', 'John Burnett', 'Introducing Marketing.PNG', 0x496e74726f647563696e67204d61726b6574696e672e706466, '583.19', 'Through good economic times and bad, marketing remains the pivotal function in any business. Determining and satisfying the needs of customers through products that have value and accessibility and whose features are clearly communicated is the general purpose of any business. It is also a fundamental definition of marketing. This text introduces students to the marketing strategies and tools that practitioners use to market their products.', 'Business, Economics, Finance, And Accounting', '2021-06-03 21:06:22.422000', '2021-06-03 21:06:22.422000'),
(20, 'Introduction to Financial Accounting 2nd Edition', 'David Annand', 'Introduction to Financial Accounting 2nd Edition.PNG', 0x496e74726f64756374696f6e20746f2046696e616e6369616c204163636f756e74696e6720326e642045646974696f6e2e706466, '483.99', '"Introduction to Financial Accounting (Second Edition)" is one of the free open textbooks in business discipline for Tertiary level.  Feel free to use, adapt and modify the content to your own needs, and share the improved content with others because the book is offered under Creative Commons (CC) license. It allows users to repurpose the materials under the condition that original authors’ contribution is acknowledged.', 'Business, Economics, Finance, And Accounting', '2021-06-03 21:07:49.954000', '2021-06-03 21:07:49.954000'),
(21, 'Principles of Economics 10th Edition', 'Karl E. Case, Ray C. Fair, and Sharon M. Oster', 'Principles of Economics 10th Edition.PNG', 0x5072696e6369706c6573206f662045636f6e6f6d69637320313074682045646974696f6e2e706466, '3833.60', 'The study of economics should begin with a sense of wonder. Pause for a moment and consider a typical day in your life. It might start with a bagel made in a local bakery with flour produced in Minnesota from wheat grown in Kansas and bacon from pigs raised in Ohio packaged in plastic made in New Jersey. You spill coffee from Colombia on your shirt made in Texas from textiles shipped from South Carolina. After class you drive with a friend on an interstate highway that is part of a system that took 20 years and billions of dollars to build. You stop for gasoline refined in Louisiana from Saudi Arabian crude oil brought to the United States on a supertanker that took 3 years to build at a shipyard in Maine. Later you log onto the Web with a laptop assembled in Indonesia from parts made in China and Skype with your brother in Mexico City, and you call a buddy on your iPhone with parts from a dozen countries. Somebody made all these things. Somebody organized men and women and materials t', 'Business, Economics, Finance, And Accounting', '2021-06-03 21:08:48.928000', '2021-06-03 21:08:48.928000'),
(22, 'Principles of Financial Accounting', 'Christine Jonick', 'Principles of Financial Accounting.PNG', 0x5072696e6369706c6573206f662046696e616e6369616c204163636f756e74696e672e706466, '1437.60', 'The University of North Georgia Press and Affordable Learning Georgia bring you Accounting I. Well-written and straightforward, Principles of Financial Accounting is a needed contribution to open source pedagogy in the business education world. Written in order to directly meet the needs of her students, this textbook developed from Dr. Christine Jonick’s years of teaching and commitment to effective pedagogy.', 'Business, Economics, Finance, And Accounting', '2021-06-03 21:09:42.520000', '2021-06-03 21:09:42.520000'),
(23, 'Chemistry: Atoms First', 'Edward J. Neth, Multiple Authors, Paul Flowers, Klaus Hellmut Theopold, William R. Robinson, Richard', 'Chemistry Atoms First.jpg', 0x4368656d69737472792041746f6d732046697273742e706466, '3111.94', 'Chemistry: Atoms First is a peer-reviewed, openly licensed introductory textbook produced through a collaborative publishing partnership between OpenStax and the University of Connecticut and UConn Undergraduate Student Government Association. This title is an adaptation of the OpenStax Chemistry text and covers scope and sequence requirements of the two-semester general chemistry course. Reordered to fit an atom first approach, this title introduces atomic and molecular structure much earlier than the traditional approach, delaying the introduction of more abstract material so students have time to acclimate to the study of chemistry. Chemistry: Atoms First also provides a basis for understanding the application of quantitative principles to the chemistry that underlies the entire course. This is a hardcover, full-color textbook.', 'Chemistry', '2021-06-03 21:10:46.581000', '2021-06-03 21:10:46.581000'),
(24, 'Environmental Chemistry: Green Chemistry and Pollutants in Ecosystems', 'Eric Lichtfouse, Jan Schwarzbauer, and Didier Robert', 'Environmental Chemistry Green Chemistry and Pollutants in Ecosystems.jpg', 0x456e7669726f6e6d656e74616c204368656d697374727920477265656e204368656d697374727920616e6420506f6c6c7574616e747320696e2045636f73797374656d732e706466, '710.48', 'Environmental chemistry is a new, fast developing science aimed at deciphering fundamental mechanisms ruling the behavior of pollutants in ecosystems. Applying this knowledge to current environmental issues lead to the remediation of environmental media, and to new, low energy, low emission, sustainable processes. This book describes the state-of-the-art advances regarding the pollution of water, soils, atmosphere, food and living organisms by toxic metals, fossil fuels, pesticides and other organic pollutants. Furthermore, the eco-toxicology section presents novel bio-assays to assess the toxicity of various pollutants such as dioxins and endocrine disrupters within complex media. The green chemistry section highlights novel chemical reactions based upon environmentally friendly conditions. The analytical chemistry section describes very sensitive methods which trace the fate of pollutants in complex ecosystems.', 'Chemistry', '2021-06-03 21:11:32.791000', '2021-06-03 21:11:32.791000'),
(25, 'Essentials of Organic Chemistry: For Students of Pharmacy, Medicinal Chemistry and Biological Chemis', 'Paul M. Dewick', 'Essentials of Organic Chemistry.jpg', 0x457373656e7469616c73206f66204f7267616e6963204368656d69737472792e706466, '2755.62', 'Essentials of Organic Chemistry is an accessible introduction to the subject for students of Pharmacy, Medicinal Chemistry and Biological Chemistry. Designed to provide a thorough grounding in fundamental chemical principles, the book focuses on key elements of organic chemistry and carefully chosen material is illustrated with the extensive use of pharmaceutical and biochemical examples.', 'Chemistry', '2021-06-03 21:12:36.887000', '2021-06-03 21:12:36.887000'),
(26, 'Foye''s Principles of Medicinal Chemistry', 'Thomas L. Lemke, David A. Williams', 'Foye''s Principles of Medicinal Chemistry.jpg', 0x466f79652773205072696e6369706c6573206f66204d65646963696e616c204368656d69737472792e706466, '1908.82', 'The Sixth Edition of this well-known text has been fully revised and updated to meet the changing curricula of medicinal chemistry courses. \r\nEmphasis is on patient-focused pharmaceutical care and on the pharmacist as a therapeutic consultant, rather than a chemist.\r\n\r\nA new disease state management section explains appropriate therapeutic options for asthma, chronic obstructive pulmonary disease, and men''s and women''s health problems. Also new to this edition: Clinical Significance boxes, Drug Lists at the beginning of appropriate chapters, and an eight-page color insert with detailed illustrations of drug structures.', 'Chemistry', '2021-06-03 21:13:21.155000', '2021-06-03 21:13:21.155000'),
(27, 'General Chemistry: Principles, Patterns, and Applications ', 'Bruce Averill, Patricia Eldredge', 'General Chemistry Principles, Patterns, and Applications.jpg', 0x47656e6572616c204368656d6973747279205072696e6369706c65732c205061747465726e732c20616e64204170706c69636174696f6e732e706466, '4169.04', 'Chemistry: Principles, Patterns, and Applications represents the next step in general chemistry texts, with an emphasis on contemporary applications and an intuitive problem-solving approach that helps students discover the exciting potential of chemical science. The book features modern applications, early integration of examples from organic and biochemistry, and a strong approach to problem solving that moves away from rote memorization to a thorough understanding of key concepts and recognition of important patterns. The worked examples throughout each chapter show students how to develop strategies and thought processes that will enable them to solve problems both quantitatively and conceptually.', 'Chemistry', '2021-06-03 21:14:13.523000', '2021-06-03 21:14:13.523000'),
(28, 'Introduction to Chemistry: 2014-2015', 'Tracy Poulsen', 'Intoduction to Chemistry.jpg', 0x496e746f64756374696f6e20746f204368656d69737472792e706466, '266.67', 'Introductory chemistry text for use by students in Nebo School District general chemistry and concurrent enrollment chemistry. This book targets the Utah State Core Curriculum for chemistry with additional content.', 'Chemistry', '2021-06-03 21:15:17.442000', '2021-06-03 21:15:17.442000'),
(29, 'Introductory Chemistry', 'David W. Ball', 'Introductory Chemistry.jpg', 0x496e74726f647563746f7279204368656d69737472792e706466, '7331.76', 'The goal of this textbook is not to make you an expert. True expertise in any field is a years-long endeavor. Here I will survey some of the basic topics of chemistry. This survey should give you enough knowledge to appreciate the impact of chemistry in everyday life and, if necessary, prepare you for additional instruction in chemistry. Throughout each chapter, I present two features that reinforce the theme of the textbook--that chemistry is all around you. The first is a feature titled, appropriately, "Chemistry Is Everywhere." Chemistry Is Everywhere" focuses on the personal hygiene products that you may use every morning: toothpaste, soap, and shampoo, among others.', 'Chemistry', '2021-06-03 21:15:54.989000', '2021-06-03 21:15:54.989000'),
(30, 'Advanced Object-Oriented Programming in R: Statistical Programming for Data Science, Analysis and Fi', 'Thomas Mailund', 'Advanced Object-Oriented Programming in R Statistical Programming for Data Science, Analysis and Finance.jpg', 0x416476616e636564204f626a6563742d4f7269656e7465642050726f6772616d6d696e6720696e205220537461746973746963616c2050726f6772616d6d696e6720666f72204461746120536369656e63652c20416e616c7973697320616e642046696e616e63652e706466, '944.56', 'Learn how to write object-oriented programs in R and how to construct classes and class hierarchies in the three object-oriented systems available in R. This book gives an introduction to object-oriented programming in the R programming language and shows you how to use and apply R in an object-oriented manner. You will then be able to use this powerful programming style in your own statistical programming projects to write flexible and extendable software. After reading Advanced Object-Oriented Programming in R, you''ll come away with a practical project that you can reuse in your own analytics coding endeavors.', 'Computer Science and Information Technology', '2021-06-03 21:17:18.232000', '2021-06-03 21:17:18.232000'),
(31, 'Information and communication technologies for development and poverty reduction: The potential of t', 'Maximo Torero, Joachim von Braun', 'Information and Communication Technologies for Development and Poverty Reduction.jpg', 0x496e666f726d6174696f6e20616e6420436f6d6d756e69636174696f6e20546563686e6f6c6f6769657320666f7220446576656c6f706d656e7420616e6420506f766572747920526564756374696f6e2e706466, '2872.56', 'The IT revolution made some glorious promises to the world''s poor: instant access to information and far-flung markets, political empowerment, greater growth, even the possibility that countries could leapfrog entire stages of development. But when none of that happened in a hurry, the hoopla gave way to concern that rather than closing the wealth gap, IT was exacerbating it. Yet for all the international debate and millions of words written about the digital divide, very little systematic empirical research or studies over time have been done to confirm claims and counterclaims and to guide policymakers on how this technology actually affects the development of low-income countries.', 'Computer Science and Information Technology', '2021-06-03 21:18:11.704000', '2021-06-03 21:18:11.704000'),
(32, 'Python Programming: An Introduction to Computer Science', 'John M. Zelle', 'Python Programming - An Introduction to Computer Science.jpg', 0x507974686f6e2050726f6772616d6d696e67202d20416e20496e74726f64756374696f6e20746f20436f6d707574657220536369656e6365202e706466, '1915.04', 'This book is suitable for use in a university-level first course in computing (CS1), as well as the increasingly popular course known as CS0. It is difficult for many students to master basic concepts in computer science and programming. A large portion of the confusion can be blamed on the complexity of the tools and materials that are traditionally used to teach CS1 and CS2. This textbook was written with a single overarching goal: to present the core concepts of computer science as simply as possible without being simplistic.', 'Computer Science and Information Technology', '2021-06-03 21:19:10.045000', '2021-06-03 21:19:10.045000'),
(33, 'Simplifying JavaScript Writing Modern JavaScript with ES5, ES6, and Beyond', 'Joe Morgan', 'Simplifying JavaScript Writing Modern JavaScript with ES5, ES6, and Beyond.jpg', 0x53696d706c696679696e67204a6176615363726970742057726974696e67204d6f6465726e204a6176615363726970742077697468204553352c204553362c20616e64204265796f6e642e706466, '576.99', 'The best modern JavaScript is simple, readable, and predictable. Learn to write modern JavaScript not by memorizing a list of new syntax, but with practical examples of how syntax changes can make code \r\nmore expressive. Starting from variable declarations that communicate intention clearly, see how modern principles can improve all parts of code. Incorporate ideas with curried functions, array methods, classes, and more to create code that does more with less while yielding fewer bugs.', 'Computer Science and Information Technology', '2021-06-03 21:20:14.944000', '2021-06-03 21:20:14.944000'),
(34, 'Theory of Computer Science: Automata, Languages and Computation', 'K. L. P. Mishra, N. CHANDRASEKARAN', 'Theory of Computer Science Automata, Languages and Computation.jpg', 0x5468656f7279206f6620436f6d707574657220536369656e6365204175746f6d6174612c204c616e67756167657320616e6420436f6d7075746174696f6e2e706466, '720.53', 'This Third Edition, in response to the enthusiastic reception given by academia and students to the previous edition, offers a cohesive presentation of all aspects of theoretical computer science, namely automata, formal languages, computability, and complexity. Besides, it includes coverage of mathematical preliminaries.', 'Computer Science and Information Technology', '2021-06-03 21:21:00.519000', '2021-06-03 21:21:00.519000'),
(35, 'Basics of Environmental Science 2nd Edition', 'Michael Allaby', 'Basics of Environmental Science 2nd Edition.jpg', 0x426173696373206f6620456e7669726f6e6d656e74616c20536369656e636520326e642045646974696f6e2e706466, '2875.20', 'Basics of Environmental Science is an engaging introduction to environmental study. The book offers everyone studying and interested in the environment, an essential understanding of natural environments and the way they function. It covers the entire breadth of the environmental sciences, providing concise, non-technical explanations of physical processes and systems and the effects of human activities.', 'Earth, Space, and Environmental Science', '2021-06-03 21:21:59.361000', '2021-06-03 21:21:59.361000'),
(36, 'Earth Dynamics Deformations and Oscillations of the Rotating Earth', 'D.E Smylie', 'Earth Dynamics Deformations and Oscillations of the Rotating Earth.jpg', 0x45617274682044796e616d696373204465666f726d6174696f6e7320616e64204f7363696c6c6174696f6e73206f662074686520526f746174696e672045617274682e706466, '6829.08', 'The Earth is a dynamic system. Internal processes, together with external gravitational forces of the Sun, Moon and planets, displace the Earth''s mass, impacting on its shape, rotation and gravitational field. Doug Smylie provides a rigorous overview of the dynamical behavior of the solid Earth, explaining the theory and presenting methods for numerical implementation. Topics include advanced digital analysis, earthquake displacement fields, Free Core Nutations observed by the Very Long Baseline Interferometric technique, translational modes of the solid inner core observed by the superconducting gravimeters, and dynamics of the outer fluid core.', 'Earth, Space, and Environmental Science', '2021-06-03 21:23:10.911000', '2021-06-03 21:23:10.911000'),
(37, 'Earth Science and Applications from Space: National Imperatives for the Next Decade and Beyond', 'National Research Council of the National Academies', 'Earth Science and Applications from Space National Imperatives for the Next Decade and Beyond.jpg', 0x456172746820536369656e636520616e64204170706c69636174696f6e732066726f6d205370616365204e6174696f6e616c20496d70657261746976657320666f7220746865204e6578742044656361646520616e64204265796f6e642e706466, '2827.28', 'Natural and human-induced changes in Earth''s interior, land surface, biosphere, atmosphere, and oceans affect all aspects of life. Understanding these changes requires a range of observations acquired from land-, sea-, air-, and space-based platforms. To assist NASA, NOAA, and USGS in developing these tools, the NRC was asked to carry out a "decadal strategy" survey of Earth science and applications from space that would develop the key scientific questions on which to focus Earth and environmental observations in the period 2005-2015 and beyond, and present a prioritized list of space programs, missions, and supporting activities \r\nto address these questions. This report presents a vision for the Earth science program; an analysis of the existing Earth Observing System and recommendations to help restore its capabilities; an assessment of and recommendations for new observations and missions for the next decade.', 'Earth, Space, and Environmental Science', '2021-06-03 21:26:21.833000', '2021-06-03 21:26:21.833000'),
(38, 'Exploring Space, Exploring Earth: New Understanding of the Earth from Space Research', 'Paul D. Lowman Jr, Paul D. Lowman', 'Exploring Space, Exploring Earth New Understanding of the Earth from Space Research.jpg', 0x4578706c6f72696e672053706163652c204578706c6f72696e67204561727468204e657720556e6465727374616e64696e67206f66207468652045617274682066726f6d2053706163652052657365617263682e706466, '3861.87', 'This book describes the impact of space flight on geology and geophysics, beginning with a foreword by Neil Armstrong, which illustrates how the exploration of space has lead us to a far deeper understanding of our own planet. Direct results from Earth-orbital missions include studies of Earth''s gravity and magnetic fields. In contrast, the recognition of the economic and biological significance of impact craters on Earth is an indirect consequence of the study of the geology of other planets. The final chapter presents a new theory for the tectonic evolution of the Earth based on comparative planetology and the Gaia concept.', 'Earth, Space, and Environmental Science', '2021-06-03 21:27:38.977000', '2021-06-03 21:27:38.977000'),
(39, 'Principles of Environmental Science & Technology', 'Dr. K. Saravanan, Prof. S. Ramachandran, & R. Baskar', 'Principles of Environmental Science & Technology.jpg', 0x5072696e6369706c6573206f6620456e7669726f6e6d656e74616c20536369656e6365202620546563686e6f6c6f67792e706466, '337.25', 'Today knowledge of Environmental Science is essential for students as well as practicing engineers and scientists of all disciplines. Here an attempt has been made to provide precise and up to date information on the fundamental aspects of Environmental Science and Engineering without going much in-depth in to specific areas, so as to be useful for a cross section of fields of study.', 'Earth, Space, and Environmental Science', '2021-06-03 21:28:25.366000', '2021-06-03 21:28:25.366000'),
(40, 'A New Companion to Digital Humanities', 'Susan Schreibman, Ray Siemens, and John Unsworth', 'A New Companion to Digital Humanities.PNG', 0x41204e657720436f6d70616e696f6e20746f204469676974616c2048756d616e69746965732e706466, '951.69', 'This highly-anticipated volume has been extensively revised to reflect changes in technology, digital humanities methods and practices, and institutional culture surrounding the valuation and publication of digital scholarship.\r\n\r\n\r\nA fully revised edition of a celebrated reference work, offering the most comprehensive and up-to-date collection of research currently available in this rapidly evolving discipline. Accessibly structured into five sections exploring infrastructures, creation, analysis, dissemination, and the future of digital humanities Surveys the past, present, and future of the field, offering essential research for anyone interested in better understanding the theory, methods, and application of the digital humanities.', 'Humanities', '2021-06-03 21:29:26.816000', '2021-06-03 21:29:26.816000'),
(41, 'Digital Humanities Pedagogy: Practices, Principles and Politics', 'Brett D. Hirsch', 'Digital Humanities Pedagogy Practices, Principles and Politics.PNG', 0x4469676974616c2048756d616e69746965732050656461676f6779205072616374696365732c205072696e6369706c657320616e6420506f6c69746963732e706466, '1195.60', 'Academic institutions are starting to recognize the growing public interest in digital humanities research, and there is an increasing demand from students for formal training in its methods. Despite the pressure on practitioners to develop innovative courses, scholarship in this area has tended to focus on research methods, theories and results rather than critical pedagogy and the actual practice of teaching. Digital Humanities pedagogy broadens the ways in which both scholars and practitioners can think about this emerging discipline, ensuring its ongoing development, vitality and long-term sustainability.', 'Humanities', '2021-06-03 21:30:25.552000', '2021-06-03 21:30:25.552000'),
(42, 'Interdisciplining Digital Humanities" Boundary Work in an Emerging Field', 'Julie Thompson Klein', 'Interdisciplining Digital Humanities Boundary Work in an Emerging Field.PNG', 0x496e7465726469736369706c696e696e67204469676974616c2048756d616e697469657320426f756e6461727920576f726b20696e20616e20456d657267696e67204669656c642e706466, '3312.71', 'Interdisciplining Digital Humanities sorts through definitions and patterns of practice over roughly sixty-five years of work, providing an overview for specialists and a general audience alike. It is the only book that tests the widespread claim that Digital Humanities is interdisciplinary. By examining the boundary work of constructing, expanding, and sustaining a new field, it depicts both the ways this new field is being situated within individual domains and dynamic cross-fertilizations that are fostering new relationships across academic boundaries. It also accounts for digital reinvigorations of “public humanities” in cultural heritage institutions of museums, archives, libraries, and community forums.', 'Humanities', '2021-06-03 21:31:17.136000', '2021-06-03 21:31:17.136000'),
(43, 'Literature, the Humanities, and Humanity', 'Theodore L. Steinberg, SUNY Fredonia', 'Literature, the Humanities, and Humanity.PNG', 0x4c6974657261747572652c207468652048756d616e69746965732c20616e642048756d616e6974792e706466, '545.72', 'Literature, the Humanities, and Humanity attempts to make the study of literature more than simply another school subject that students have to take. At a time when all subjects seem to be valued only for their testability, this book tries to show the value of reading and studying literature, even earlier literature. It shows students, some of whom will themselves become teachers, that literature actually has something to say to them. Furthermore, it shows that literature is meant to be enjoyed, that, as the Roman poet Horace (and his Renaissance Disciple Sir Philip Sidney) said, the functions of literature are to teach and to delight. The book will also be useful to teachers who want to convey their passion for literature to their students. After an introductory chapter that offers advice on how to read (and teach) literature, the book consists of a series of chapters that examine individual literary works ranging from The Iliad to Charles Dickens'' Bleak House.', 'Humanities', '2021-06-03 21:32:45.225000', '2021-06-03 21:32:45.225000'),
(44, 'The Neganthropocene', 'Bernard Stiegler', 'The Neganthropocene.PNG', 0x546865204e6567616e7468726f706f63656e652e706466, '958.40', 'We drift past tipping points that put future biota at risk, while a post-truth regime institutes the denial of ‘climate change’ (as fake news), and as Silicon Valley assistants snatch decision and memory, and as gene-editing and a financially-engineered bifurcation advances over the rising hum of extinction events and the innumerable toxins and conceptual opiates that Anthropocene Talk fascinated itself with—in short, as ‘the Anthropocene’ discloses itself as a dead-end trap—Bernard Stiegler here produces the first counter-strike and moves beyond the entropic vortex and the mnemonically stripped Last Man socius feeding the vortex.', 'Humanities', '2021-06-03 21:34:05.437000', '2021-06-03 21:34:05.437000'),
(45, 'Tracking Changes in the Humanities', 'James C. Hearn, Alexander V. Gorbunov, Donald C. Summers, Edward P. St. John, Ontario S. Wooden, Pat', 'Tracking Changes in the Humanities.PNG', 0x547261636b696e67204368616e67657320696e207468652048756d616e69746965732e706466, '303.45', 'In 1998, the American Academy of Arts and Sciences began an Initiative for the Humanities and Culture designed to underline the importance of the humanities to American civic and cultural life. Data on the state of the humanities has been a key focus of the Initiative from its beginning. This volume, Tracking Changes in the Humanities: Essays on Finance and Education, is the third in a series of publications exploring the nature and implications of humanities data. ', 'Humanities', '2021-06-03 21:36:25.884000', '2021-06-03 21:36:25.884000'),
(46, 'Criminology: A sociological introduction', 'Eamonn Carrabine, Alexandra Cox, Pamela Cox, Anna Di Ronco, Isabel Crowhurst, Pete Fussey, Nigel Sou', 'Criminology - A Sociological Introduction.jpg', 0x4372696d696e6f6c6f6779202d204120536f63696f6c6f676963616c20496e74726f64756374696f6e2e706466, '2157.30', 'Comprehensive, critical and accessible, Criminology: A Sociological Introduction offers an authoritative overview of the study of criminology, from early theoretical perspectives to pressing contemporary issues such as the globalization of crime, crimes against the environment, terrorism and cybercrime. The new edition fuses global perspectives in Criminology, from the contexts of post-Brexit Britain and America in the age of Trump, and from the Global South. It contains new chapters on cybercrime; crimes of the powerful; organized crime; life-course approaches to understanding delinquency and desistance; and futures of crime, control and criminology.', 'Law and Criminology', '2021-06-03 21:37:40.741000', '2021-06-03 21:37:40.741000'),
(47, 'Criminology: The Key Concepts', 'Martin O''Brien and Majid Yar', 'Criminology - The Key Concepts.jpg', 0x4372696d696e6f6c6f6779202d20546865204b657920436f6e63657074732e706466, '1402.72', 'Criminology: The Key Concepts is an authoritative and comprehensive study guide and reference resource that will take you through all the concepts, approaches, issues and institutions central to the study of crime in contemporary society.', 'Law and Criminology', '2021-06-03 21:38:28.894000', '2021-06-03 21:38:28.894000'),
(48, 'Criminology: Explaining Crime and Its Context', 'Stephen E. Brown, Finn-Aage Esbensen, Gilbert Geis', 'Criminology Explaining Crime and Its Context.jpg', 0x4372696d696e6f6c6f6779204578706c61696e696e67204372696d6520616e642049747320436f6e746578742e706466, '1029.80', 'This highly acclaimed criminology text presents an up-to-date review and analysis of criminological theories. It incorporates current examples of deterrence research regarding crimes such as domestic violence, drunk driving, and capital punishment, and features thought-provoking discussion of the relativity of crime. Extensive discussion of evolving laws is included, and while the prevalence of the scientific method in the field of criminology is highlighted, the impact of ideology on explanations of crime is the cornerstone of the book. Biosocial Theories of Crime retaining much of the thoughtful historical discussion of earlier editions, but incorporating a substantial expansion of current biological research integrated with both social and biological variables.', 'Law and Criminology', '2021-06-03 21:39:20.506000', '2021-06-03 21:39:20.506000'),
(49, 'Forensic Criminology', 'Wayne Petherick, Brent E. Turvey, Claire E. Ferguson', 'Forensic Criminology.jpg', 0x466f72656e736963204372696d696e6f6c6f67792e706466, '3638.44', 'Forensic Criminology gives students of criminology and criminal justice an introduction to the forensic realm and the applied forensic issues they will face when working cases within the justice system. It effectively bridges the theoretical world of social criminology with the applied world of the criminal justice system. This book focuses on navigating casework in forensic contexts by case-working criminologists, rather than broad social theory. It also allows criminology/criminal justice instructors outside of the forensic sciences the ability to develop and instruct a core course that might otherwise be considered beyond their expertise, or in conflict with forensic courses taught in chemistry, biology, or medical programs at their institutions because of its focus on criminology and criminal justice careers.', 'Law and Criminology', '2021-06-03 21:40:03.912000', '2021-06-03 21:40:03.912000'),
(50, 'The Fingerprint: Sourcebook', 'U.S. Department of Justice', 'The Finger Print.jpg', 0x5468652046696e676572205072696e742e706466, '1150.08', 'The idea of The Fingerprint Sourcebook originated during a meeting in April 2002. Individuals representing the fingerprint, academic, and scientific communities met in Chicago, Illinois, for a day and a half to discuss the state of fingerprint identification with a view toward the challenges raised by Daubert issues. One recommendation that came out of that meeting was a suggestion to create a sourcebook for friction ridge examiners, that is, a single source of researched information regarding the subject. This sourcebook would provide educational, training, and research information for the international scientific community.', 'Law and Criminology', '2021-06-03 21:40:49.111000', '2021-06-03 21:40:49.111000'),
(51, 'The Law of Nations, Or, Principles of the Law of Nature Applied to the Conduct and Affairs of Nation', 'Edward Duncan Ingraham, Emer De Vattel', 'The Law of Nations.jpg', 0x546865204c6177206f66204e6174696f6e732e706466, '1148.16', 'This work has been selected by scholars as being culturally important, and is part of the knowledge base of civilization as we know it. This work was reproduced from the original artifact, and remains as true to the original work as possible. Therefore, you will see the original copyright references, library stamps (as most of these works have been housed in our most important libraries around the world), and other notations in the work.', 'Law and Criminology', '2021-06-03 21:41:36.350000', '2021-06-03 21:41:36.350000'),
(52, 'Thinking Like a Lawyer: A New Introduction to Legal Reasoning', 'Frederick Schauer', 'Thinking Like A Lawyer.jpg', 0x5468696e6b696e67204c696b652041204c61777965722e706466, '1058.52', 'This primer on legal reasoning is aimed at law students and upper-level undergraduates. But it is also an original exposition of basic legal concepts that scholars and lawyers will find stimulating. It covers such topics as rules, precedent, authority, analogical reasoning, the common law, statutory interpretation, legal realism, judicial opinions, legal facts, and burden of proof.', 'Law and Criminology', '2021-06-03 21:42:13.270000', '2021-06-03 21:42:13.270000'),
(53, 'Cognitive Neuroscience', 'Marie T. Banich, Rebecca J. Compton', 'Cognitive Neuroscience.PNG', 0x436f676e6974697665204e6575726f736369656e63652e706466, '1389.78', 'Updated fully, this accessible and comprehensive text highlights the most important theoretical, conceptual and methodological issues in cognitive neuroscience. Written by two experienced teachers, the consistent narrative ensures that students link concepts across chapters, and the careful selection of topics enables them to grasp the big picture without getting distracted by details. Clinical applications such as developmental disorders, brain injuries and dementias are highlighted. In addition, analogies and examples within the text, opening case studies, and ''In Focus'' boxes engage students and demonstrate the relevance of the material to real-world concerns. A new chapter on neuroscience and society considers how cognitive neuroscience issues relate to the law, education, and ethics, highlighting the clinical and real-world relevance. An expanded online package includes a test bank.', 'Life Science', '2021-06-03 21:43:03.924000', '2021-06-03 21:43:03.924000');
INSERT INTO `books_table` (`BOOK_ID`, `BOOK_TITLE`, `BOOK_AUTHOR`, `BOOK_COVER`, `BOOK_FILE`, `BOOK_PRICE`, `BOOK_DESC`, `BOOK_CATEGORY`, `BOOK_CREATED_DATE`, `BOOK_MODIFIED_DATE`) VALUES
(54, 'Earth Science 2015-2016', 'Utah State Utah State Office of Education', 'Earth Science.PNG', 0x456172746820536369656e63652e706466, '200.00', 'This Earth Science textbook is designed for use in Utah during the 2015-2016 academic year. This book was developed by the Utah State Office of Education and is aligned to the Utah Science Core. This book is based on materials originally published by CK-12 under a Creative Commons BY NC SA license. This book is licensed under those same terms.', 'Life Science', '2021-06-03 21:43:59.411000', '2021-06-03 21:43:59.411000'),
(55, 'Student Workbook for Essentials of Anatomy and Physiology', 'Valerie C. Scanlon, Tina Sanders', 'Student Workbook for Essentials of Anatomy and Physiology.PNG', 0x53747564656e7420576f726b626f6f6b20666f7220457373656e7469616c73206f6620416e61746f6d7920616e642050687973696f6c6f67792e706466, '1245.00', 'Serving as a companion to the textbook, this workbook reinforces what students learn in each chapter of Essentials of Anatomy and Physiology, 5th Edition. It features illustrations, fill-in questions, figure labeling and coloring activities, and chapter review crossword puzzles.', 'Life Science', '2021-06-03 21:45:16.609000', '2021-06-03 21:45:16.609000'),
(56, 'Life: The Science of Biology, Volume 1', 'David E. Sadava, David M. Hillis, H. Craig Heller, May Berenbaum', 'Life The Science of Biology, Volume 1.PNG', 0x4c6966652054686520536369656e6365206f662042696f6c6f67792c20566f6c756d6520312e706466, '3187.05', 'The science of biology evolves. The science classroom and lab evolve. In this edition, as always, Life: The Science of Biology evolves with them, in innovative, authoritative, and captivating ways.', 'Life Science', '2021-06-03 21:46:10.826000', '2021-06-03 21:46:10.826000'),
(57, 'Principles of Genetics', 'D. Peter Snustad, Michael J. Simmons', 'Principles of Genetics.PNG', 0x5072696e6369706c6573206f662047656e65746963732e706466, '762.46', 'Principles of Genetics is one of the most popular texts in use for the introductory course. It opens a window on the rapidly advancing science of genetics by showing exactly how genetics is done. Throughout, the authors incorporate a human emphasis and highlight the role of geneticists to keep students interested and motivated. The sixth edition has been updated to reflect the latest developments in the field of genetics. Principles of Genetics continues to educate today’s students for tomorrow’s science by focusing on features that aid in content comprehension and application.', 'Life Science', '2021-06-03 21:47:08.752000', '2021-06-03 21:47:08.752000'),
(58, 'An Introduction to Probability and Statistics', 'A. K. Md. Ehsanes Saleh', 'An Introduction to Probability and Statistics.jpg', 0x416e20496e74726f64756374696f6e20746f2050726f626162696c69747920616e6420537461746973746963732e706466, '3241.79', 'The second edition of a well-received book that was published 24 years ago and continues to sell to this day, An Introduction to Probability and Statistics is now revised to incorporate new information as well as substantial updates of existing material.', 'Mathematics and Statistics', '2021-06-03 21:47:50.314000', '2021-06-03 21:47:50.314000'),
(59, 'Basic Mathematics for College Students 4th Edition', 'Alan S. Tussy, Roy David Gustafson, Diane Koenig', 'Basic Mathematics for College Students.jpg', 0x4261736963204d617468656d617469637320666f7220436f6c6c6567652053747564656e74732e706466, '718.32', 'Offering a uniquely modern, balanced approach, BASIC MATHEMATICS FOR COLLEGE STUDENTS, Fourth Edition, integrates the best of traditional drill and practice with the best elements of the reform movement. To many developmental math students, mathematics is like a foreign language. They have difficulty translating the words, their meanings, and how they apply to problem solving. Emphasizing the "language of mathematics," the text''s fully integrated learning process is designed to expand students'' reasoning abilities and teach them how to read, write, and think mathematically. It blends instructional approaches that include vocabulary, practice, and well-defined pedagogy with an emphasis on reasoning, modeling, communication, and technology skills.', 'Mathematics and Statistics', '2021-06-03 21:49:02.173000', '2021-06-03 21:49:02.173000'),
(60, 'Business Statistics for Contemporary Decision Making', 'Ken Black', 'Business Statistics for Contemporary Decision Making.jpg', 0x427573696e657373205374617469737469637320666f7220436f6e74656d706f72617279204465636973696f6e204d616b696e672e706466, '4503.52', 'Applying the Power of Statistics to business Strategies. Every business area relies on an understanding of statistics to succeed. Ken black''s business Statistics: contemporary Decision making effectively equips students with the quantitative decision-making skills and analysis techniques needed to make smart decisions based on real-world data. The Sixth Edition helps professors to facilitate a highly successful, mathematically appropriate experience for each business statistics student.', 'Mathematics and Statistics', '2021-06-03 21:50:31.703000', '2021-06-03 21:50:31.703000'),
(61, 'Discrete Mathematics: Mathematical Reasoning and Proof with Puzzles, Patterns, and Games', 'Douglas E. Ensley and J. Winston Crawley', 'Discrete Mathematics - Mathematical Reasoning and Proof with Puzzles, Patterns, and Games.jpg', 0x4469736372657465204d617468656d6174696373202d204d617468656d61746963616c20526561736f6e696e6720616e642050726f6f6620776974682050757a7a6c65732c205061747465726e732c20616e642047616d65732e706466, '3783.28', 'These active and well-known authors have come together to create a fresh, innovative, and timely approach to Discrete Math.  One innovation uses several major threads to help weave core topics into a cohesive whole.  Throughout the book the application of mathematical reasoning is emphasized to solve problems while the authors guide the student in thinking about, reading, and writing proofs in a wide variety of contexts.  Another important content thread, as the sub-title implies, is the focus on \r\nmathematical puzzles, games and magic tricks to engage students.', 'Mathematics and Statistics', '2021-06-03 21:51:27.449000', '2021-06-03 21:51:27.449000'),
(62, 'Mathematics and Technology', 'Christiane Rousseau and Yvan Saint-Aubin ', 'Mathematics and Technology.jpg', 0x4d617468656d617469637320616e6420546563686e6f6c6f67792e706466, '1102.16', 'This book introduces the student to numerous modern applications of mathematics in technology. An engaging quality of this book is that the authors also present the mathematical material in a historical context and not just the practical one. Mathematics and Technology is intended for undergraduate students in mathematics, instructors and high school teachers. Additionally, its lack of calculus centricity as well as a clear indication of the more difficult topics and relatively advanced references make it suitable for any curious individual with a decent command of high school math.', 'Mathematics and Statistics', '2021-06-03 21:52:13.123000', '2021-06-03 21:52:13.123000'),
(63, 'ABC of Learning and Teaching in Medicine', 'Peter Cantillon, Diana F. Wood, Sarah Yardley', 'ABC of Learning and Teaching in Medicine.PNG', 0x414243206f66204c6561726e696e6720616e64205465616368696e6720696e204d65646963696e652e706466, '1411.83', 'ABC of Learning and Teaching in Medicine is an invaluable resource for both novice and experienced medical teachers. It emphasizes the teacher’s role as a facilitator of learning rather than a transmitter of knowledge, and is designed to be practical and accessible not only to those new to the profession, but also to those who wish to keep abreast of developments in medical education.', 'Medicine', '2021-06-03 21:53:20.625000', '2021-06-03 21:53:20.625000'),
(64, 'Clinical Guidelines on the Identification, Evaluation, and Treatment of Overweight and Obesity in Ad', 'Lung National Heart, Nih', 'Clinical Guidelines on the Identification, Evaluation, and Treatment of Overweight and Obesity in Adults The Evidence Report.PNG', 0x436c696e6963616c2047756964656c696e6573206f6e20746865204964656e74696669636174696f6e2c204576616c756174696f6e2c20616e642054726561746d656e74206f66204f76657277656967687420616e64204f62657369747920696e204164756c7473205468652045766964656e6365205265706f72742e706466, '623.35', 'The recommendation to treat overweight and obesity is based not only on evidence that relates obesity to increased mortality but also on evidence that weight loss reduces risk factors for disease. Thus, weight loss may not only help control diseases worsened by obesity, it may also help decrease the likelihood of developing these diseases. The NIH panel reviewed relevant treatment strategies designed for weight loss that can also be used to foster long-term weight control and prevention of weight gain. The consequent recommendations emphasize the potential effectiveness of weight control using multiple interventions and strategies, including dietary therapy, physical activity, behavior therapy, pharmacotherapy, and surgery, as well as combinations of these strategies. While the predominant audience is public health, the style of Overweight and Obesity lends itself as a practical text for primary care and endocrinology.', 'Medicine', '2021-06-03 21:54:17.320000', '2021-06-03 21:54:17.320000'),
(65, 'Introduction to Human Osteology', 'Roberta Hall, Kenneth Beals, Holm Neumann, Georg Neumann, Gwyn Madden', 'Introduction to Human Osteology.PNG', 0x496e74726f64756374696f6e20746f2048756d616e204f7374656f6c6f67792e706466, '2550.00', 'This text was designed for use in the human osteology laboratory classroom. Bones are described to aid in identification of skeletonized remains in either an archaeological or forensic anthropology setting. Basic techniques for siding, aging, sexing and stature estimation are described. Both images of bone and drawings are included which may be used for study purposes outside of the classroom. The text represents work that has been developed over more than 30 years by its various authors and is meant to present students with the basic analytical tools for the study of human osteology.', 'Medicine', '2021-06-03 21:55:34.496000', '2021-06-03 21:55:34.496000'),
(66, 'Pandemic 1918: The Story of the Deadliest Influenza in History', 'Catharine Arnold', 'Pandemic 1918 The Story of the Deadliest Influenza in History.PNG', 0x50616e64656d69632031393138205468652053746f7279206f662074686520446561646c6965737420496e666c75656e7a6120696e20486973746f72792e706466, '1490.79', 'In the dying months of World War I, Spanish flu suddenly overwhelmed the world, killing between 50 and 100 million people. German soldiers termed it Blitzkatarrh, British soldiers called it Flanders Grippe, but globally the pandemic gained the notorious title of ''Spanish Flu''. Nowhere escaped this common enemy: in Britain, 250,000 people died, in the United States it was 750,000, five times its total military fatalities in the war, while European deaths reached over two million. The numbers are staggering. And yet at the time, news of the danger was suppressed for fear of impacting war-time morale. Even today these figures are shocking to many - the war still hiding this terrifying menace in its shadow.', 'Medicine', '2021-06-03 21:56:17.552000', '2021-06-03 21:56:17.552000'),
(67, 'Principles of Toxicology', 'Dr. Paul Héroux, PhD.', 'Principles of Toxicology.PNG', 0x5072696e6369706c6573206f6620546f7869636f6c6f67792e706466, '2391.41', 'Toxicology studies the injurious effects of chemical and physical agents (including energy) on living organisms, observed as alterations in structure and function. The variety of injurious effects becomes apparent if we examine the major causes of death. Many of these diseases are caused or accelerated by exposure to toxic substances. Toxicity data from various bio-medical sciences document the effects of exposure to natural or artificial agents. ', 'Medicine', '2021-06-03 21:56:58.384000', '2021-06-03 21:56:58.384000'),
(68, 'Principles of Toxicology: Environmental and Industrial Applications', 'Stephen M. Roberts, Robert C. James, Phillip L. Williams', 'Principles of Toxicology Environmental and Industrial Applications.PNG', 0x5072696e6369706c6573206f6620546f7869636f6c6f677920456e7669726f6e6d656e74616c20616e6420496e647573747269616c204170706c69636174696f6e732e706466, '4567.18', 'A fully updated and expanded edition of the bestselling guide on toxicology and its practical application. Covering the diverse chemical hazards encountered in the modern work and natural environment, and provides a practical understanding of these hazards, New chapters cover the emerging areas of toxicology such as omics, computational toxicology, and Nano toxicology Providing clear explanations and practical understanding of the fundamentals necessary for an understanding of the effects of chemical hazards on human health and ecosystems and Includes case histories and examples from industry demonstrate the application of toxicological principles Supplementing with numerous illustrations to clarify and summarize key points, annotated bibliographies, and a comprehensive glossary of toxicological terms.', 'Medicine', '2021-06-03 21:57:42.768000', '2021-06-03 21:57:42.768000'),
(69, 'Angels & Demons', 'Dan Brown', 'Angels & Demons.jpg', 0x416e67656c7320262044656d6f6e732e706466, '988.11', 'Angels & Demons careens from enlightening epiphanies to dark truths as the battle between science and religion turns to war. This is the book that started it all: we meet Robert Langdon for the first time, caught up in a race against time to find an apocalyptic time-bomb, planted by an ancient secret society that has surfaced to carry out its ultimate threat: to destroy the Vatican.', 'Novel', '2021-06-03 21:58:25.469000', '2021-06-03 21:58:25.469000'),
(70, 'Boundaries: When to Say Yes, How to Say No to Take Control of Your Life', 'Henry Cloud', 'Boundaries When to Say Yes, How to Say No to Take Control of Your Life.PNG', 0x426f756e646172696573205768656e20746f20536179205965732c20486f7720746f20536179204e6f20746f2054616b6520436f6e74726f6c206f6620596f7572204c6966652e706466, '1405.97', 'Having clear boundaries is essential to a healthy, balanced lifestyle. A boundary is a personal property line that marks those things for which we are responsible. In other words, boundaries define who we are and who we are not. Boundaries impact all areas of our lives: Physical boundaries help us determine who may touch us and under what circumstances Mental boundaries give us the freedom to have our own thoughts and opinions Emotional boundaries help us to deal with our own emotions and disengage from the harmful, manipulative emotions of others Spiritual boundaries help us to distinguish God''s will from our own and give us renewed awe for our Creator -- Often, Christians focus so much on being loving and unselfish that they forget their own limits and limitations.', 'Novel', '2021-06-03 21:59:37.624000', '2021-06-03 21:59:37.624000'),
(71, 'The Course of Love', 'Alain de Botton', 'The Course of Love.PNG', 0x54686520436f75727365206f66204c6f76652e706466, '1005.84', 'This is a Romantic novel in the true sense, one interested in exploring how love can survive and thrive in the long term. The result is a sensory experience—fictional, philosophical, psychological—that urges us to identify deeply with these characters and to reflect on his and her own experiences in love. Fresh, visceral, and utterly compelling, The Course of Love is a provocative and life-affirming novel for everyone who believes in love.', 'Novel', '2021-06-03 22:00:24.495000', '2021-06-03 22:00:24.495000'),
(72, 'The Da Vinci Code', 'Dan Brown', 'The Da Vinci Code.PNG', 0x5468652044612056696e636920436f64652e706466, '622.96', 'While in Paris, Harvard symbolist Robert Langdon is awakened by a phone call in the dead of the night. The elderly curator of the Louvre has been murdered inside the museum, his body covered in baffling symbols. As Langdon and gifted French cryptologist Sophie Neveu sort through the bizarre riddles, they are stunned to discover a trail of clues hidden in the works of Leonardo da Vinci—clues visible for all to see and yet ingeniously disguised by the painter.', 'Novel', '2021-06-03 22:01:08.018000', '2021-06-03 22:01:08.018000'),
(73, 'The Gifts of Imperfection: Let Go of Who You Think You''re Supposed to Be and Embrace Who You Are', 'Brene Brown', 'The Gifts of Imperfection Let Go of Who You Think You''re Supposed to Be and Embrace Who You Are.PNG', 0x546865204769667473206f6620496d70657266656374696f6e204c657420476f206f662057686f20596f75205468696e6b20596f7527726520537570706f73656420746f20426520616e6420456d62726163652057686f20596f75204172652e706466, '832.37', 'New York Times best-selling author and professor Brené Brown offers a powerful and inspiring book that explores how to cultivate the courage, compassion, and connection to embrace your imperfections and to recognize that you are enough. In The Gifts of Imperfection, Brene Brown, PhD, a leading expert on shame, authenticity and belonging, shares what she''s learned from a decade of research on the power of Wholehearted Living--a way of engaging with the world from a place of worthiness. In her ten guideposts, Brown engages our minds, hearts, and spirits as she explores how we can cultivate the courage, compassion, and connection to wake up in the morning and think.', 'Novel', '2021-06-03 22:01:48.931000', '2021-06-03 22:01:48.931000'),
(74, 'Then She was Gone: A Novel', 'Lisa Jewell', 'Then She was Gone A Novel.PNG', 0x5468656e205368652077617320476f6e652041204e6f76656c2e706466, '3066.88', 'Ellie Mack was the perfect daughter. She was fifteen, the youngest of three. She was beloved by her parents, friends, and teachers. She and her boyfriend made a teenaged golden couple. She was days away from an idyllic post-exams summer vacation, with her whole life ahead of her. And then she was gone.\r\n\r\nNow, her mother Laurel Mack is trying to put her life back together. It’s been ten years since her daughter disappeared, seven years since her marriage ended, and only months since the last clue in Ellie’s case was unearthed. So when she meets an unexpectedly charming man in a café, no one is more surprised than Laurel at how quickly their flirtation develops into something deeper. Before she knows it, she’s meeting Floyd’s daughters—and his youngest, Poppy, takes Laurel’s breath away. Because looking at Poppy is like looking at Ellie. And now, the unanswered questions she’s tried so hard to put to rest begin to haunt Laurel anew.', 'Novel', '2021-06-03 22:02:32.467000', '2021-06-03 22:02:32.467000'),
(75, 'Comprehensive Healthcare Simulation: Mastery Learning in Health Professions Education', 'McGaghie, William C., Barsuk, Jeffrey, Wayne, Diane B', 'Comprehensive Healthcare Simulation Mastery Learning in Health Professions Education.PNG', 0x436f6d70726568656e73697665204865616c7468636172652053696d756c6174696f6e204d617374657279204c6561726e696e6720696e204865616c74682050726f66657373696f6e7320456475636174696f6e2e706466, '4072.72', 'This book presents the parameters of Mastery Learning (ML), an especially stringent variety of competency-based education that guides students to acquire essential knowledge and skill, measured rigorously against a minimum passing standard (MPS). A seminal source of information and practical advice about ML, this book divided into five parts: Clinical Education in the Health Professions, The Mastery Learning Model, Mastery Learning in Action, Transfer of Training from Mastery Learning and The Road Ahead. Complete with high-quality images and tables, chapters take an in-depth look into ML principles and practices across the health professions.', 'Nursing, Dentistry, and Healthcare', '2021-06-03 22:03:24.171000', '2021-06-03 22:03:24.171000'),
(76, 'Dentist''s Guide to Medical Conditions, Medications, and Complications, Second Edition', 'Kanchan M. Ganda M.D.', 'Dentist''s Guide to Medical Conditions, Medications, and Complications, Second Edition.PNG', 0x44656e74697374277320477569646520746f204d65646963616c20436f6e646974696f6e732c204d656469636174696f6e732c20616e6420436f6d706c69636174696f6e732c205365636f6e642045646974696f6e2e706466, '4362.64', 'The second edition of Dentist’s Guide to Medical Conditions, Medications and Complications continues to provide quick-access, clinical information on the dental treatment of patients with common systemic conditions and medical complications. Expanded in this second edition is information about patient medications. Ideal for general practitioners and \r\nstudents in advanced general dentistry programs, the book outlines protocols for treating patients with common conditions, presents essential drug interaction information, and guides the dental professional through prevention and management of in-office medical emergencies.', 'Nursing, Dentistry, and Healthcare', '2021-06-03 22:04:07.554000', '2021-06-03 22:04:07.554000'),
(77, 'Essentials of Nursing Leadership & Management 5th Edition', 'Diane K. Whitehead, Sally A. Weiss, and Ruth M. Tappen', 'Essentials of Nursing Leadership & Management 5th Edition.PNG', 0x457373656e7469616c73206f66204e757273696e67204c6561646572736869702026204d616e6167656d656e74203574682045646974696f6e2e706466, '835.72', 'Transition from student to professional with confidence. Stepping out of the classroom and into professional nursing practice can be stressful. This handy guide will build your confidence and prepare you to meet the challenges you’ll face as a new staff nurse in today’s dynamic health-care environment. You’ll explore your future responsibilities as a leader and a manager and the workplace issues and trends that you’ll encounter in practice.', 'Nursing, Dentistry, and Healthcare', '2021-06-03 22:10:45.363000', '2021-06-03 22:10:45.363000'),
(78, 'Essentials of Physiology for Dental Students', 'K Semnulingam and Prema Sembulingam', 'Essentials of Physiology for Dental Students.PNG', 0x457373656e7469616c73206f662050687973696f6c6f677920666f722044656e74616c2053747564656e74732e706466, '1723.20', 'Essential Physiology for Dental Students offers comprehensive information on human physiology, tailored to the needs of students of dentistry. This new addition to the Dentistry Essentials series helps students gain a deeper understanding of how physiological concepts apply to clinical dental practice. Each chapter outlines an organ system in sufficient detail whilst emphasizing its relevance to clinical dentistry. Written in a student-friendly style, it contextualizes how normal and altered physiology affects dental care and highlights the implications of dental interventions on the body''s functioning. ', 'Nursing, Dentistry, and Healthcare', '2021-06-03 22:11:39.495000', '2021-06-03 22:11:39.495000'),
(79, 'Nursing Theories & Nursing Practice 3rd Edition', 'Marilyn E. Parker, PhD, RN, FAAN Marlaine C. Smith, PhD, RN, AHN-BC, FAAN', 'Nursing Theories & Nursing Practice 3rd Edition.PNG', 0x4e757273696e67205468656f726965732026204e757273696e67205072616374696365203372642045646974696f6e2e706466, '1436.16', 'This book offers the perspective that nursing is a professional discipline with a body of knowledge that guides its practice. Nursing theories are an important part of this body of knowledge, and regardless of complexity or abstraction, reflect nursing and should be used by nurses to frame their thinking, action, and being in the world. As guides, nursing theories are practical in nature and facilitate communication with those we serve as well as with colleagues, students, and others practicing in health-related services. Our hope is that this book illuminates for the reader the interrelationship between nursing theories and nursing practice, and that this will focus practice more meaningfully and make a difference in the health and quality of life of people who are recipients of nursing care.', 'Nursing, Dentistry, and Healthcare', '2021-06-03 22:12:15.890000', '2021-06-03 22:12:15.890000'),
(80, 'Control Engineering – An introduction with the use of Matlab', 'Derek Atherton', 'Control Engineering – An introduction with the use of Matlab.jpg', 0x436f6e74726f6c20456e67696e656572696e6720e2809320416e20696e74726f64756374696f6e20776974682074686520757365206f66204d61746c61622e706466, '264.00', 'Explanations of the mathematical concepts used in classical control such as root loci, frequency response and stability methods are explained by making use of MATLAB plots but omitting the detailed mathematics found in many textbooks. There is a chapter on PID control and two chapters provide brief coverage of state variable methods. The approach adopted allows more time to be devoted to controller design by different methods, to compare the results and also to examine the effects of plant parameter \r\nvariations.', 'Physical Science and Engineering', '2021-06-03 22:13:18.552000', '2021-06-03 22:13:18.552000'),
(81, 'Engineering Mechanics Statics (7th Edition)', 'J. L. Meriam, L. G. Kraige', 'Engineering Mechanics Statics (7th Edition).jpg', 0x456e67696e656572696e67204d656368616e696373205374617469637320283774682045646974696f6e292e706466, '6906.23', 'The book represented a revolutionary transformation in undergraduate mechanics’ education. They became the definitive textbooks for the decades that followed as well as models for other engineering mechanics texts that have subsequently appeared. Published under slightly different titles prior to the 1978 First Editions, this textbook series has always been characterized by logical organization, clear and rigorous presentation of the theory, instructive sample problems, and a rich collection of real-life problems, all with a high standard of illustration. In addition to the U.S. versions, the books have appeared in SI versions and have been translated into many foreign languages. These texts collectively represent an international standard for undergraduate texts in mechanics.', 'Physical Science and Engineering', '2021-06-03 22:14:17.878000', '2021-06-03 22:14:17.878000'),
(82, 'Food Process Engineering and Technology', 'Zeki Berk', 'Food Process Engineering and Technology.jpg', 0x466f6f642050726f6365737320456e67696e656572696e6720616e6420546563686e6f6c6f67792e706466, '4310.88', 'Food Process Engineering and Technology, Third Edition combines scientific depth with practical usefulness, creating a tool for graduate students and practicing food engineers, technologists and researchers looking for the latest information on transformation and preservation processes and process control and plant hygiene topics. This fully updated edition provides recent research and developments in the area, features sections on elements of food plant design, an introductory section on the elements of classical fluid mechanics, a section on non-thermal processes, and recent technologies, such as freeze concentration, osmotic dehydration, and active packaging that are discussed in detail.', 'Physical Science and Engineering', '2021-06-03 22:14:57.434000', '2021-06-03 22:14:57.434000'),
(83, 'Mechanical Engineering Principles', 'John Bird and Carl Ross ', 'Mechanical Engineering Principles.jpg', 0x4d656368616e6963616c20456e67696e656572696e67205072696e6369706c65732e706466, '1868.40', 'This book introduces mechanical principles and technology through examples and applications rather than theory. John Bird and Carl Ross do not assume any previous background in engineering studies, and as such this book can act as a core textbook for several engineering courses. This approach enables students to develop a sound understanding of engineering principles and their use in practice. These theoretical concepts are supported by 320 fully worked problems, nearly 600 further problems with answers, and 276 multiple-choice questions giving the reader a firm grounding on each topic.', 'Physical Science and Engineering', '2021-06-03 22:15:28.371000', '2021-06-03 22:15:28.371000'),
(84, 'CPO Focus on Physical Science', 'Taylor and Reed ', 'CPO Focus on Physical Science.jpg', 0x43504f20466f637573206f6e20506879736963616c20536369656e63652e706466, '1102.16', '2007 [An Integrated Middle School Series] CPO Focus on Physical Science California Edition Teacher''s Guide (CA)(TE)(H)by Sonja L. Taylor, Catherine C. Reed, & Patsy Eldridge.', 'Physical Science and Engineering', '2021-06-03 22:16:13.170000', '2021-06-03 22:16:13.170000'),
(85, 'Glencoe Physical Science with Earth Science, Student Edition', 'McGraw-Hill Education', 'Glencoe Physical Science with Earth Science, Student Edition.jpeg', 0x476c656e636f6520506879736963616c20536369656e6365207769746820456172746820536369656e63652c2053747564656e742045646974696f6e2e706466, '3594.00', 'Give every student a deeper understanding of physical science Physical Science with Earth provides students with accurate and comprehensive content coverage of physical science integrated with Earth science. By integrating Earth and space science concepts within each unit, students can explore the physics and chemistry in greater depth by learning how those concepts apply to Earth and space systems. ', 'Physical Science and Engineering', '2021-06-03 22:17:16.109000', '2021-06-03 22:17:16.109000'),
(86, '30-second Psychology: The 50 Most Thought-provoking Psychology Theories, Each Explained in Half a Mi', 'Christian Jarrett', '30 Second Psychology.jpg', 0x3330205365636f6e642050737963686f6c6f67792e706466, '766.02', '"30-Second Psychology takes the top 50 strands of thinking in this fascinating field, and explains them to the general reader in half a minute, using nothing more than two pages, 300 words, and one picture. While unraveling the inner workings of the human mind it also introduces many of the luminaries in the field along the way, including William James, Aaron Beck, and (of course) Sigmund Freud. From Behaviorism to Cognitivism, what better way to get a handle on your inner demons?"', 'Psychology', '2021-06-03 22:17:52.782000', '2021-06-03 22:17:52.782000'),
(87, 'Counseling Psychology: An Integrated Positive Psychological Approach', 'Ruth Chu-Lien Chao', 'Counseling Psychology - An Integrated Positive Psychological Approach.jpg', 0x436f756e73656c696e672050737963686f6c6f6779202d20416e20496e746567726174656420506f7369746976652050737963686f6c6f676963616c20417070726f6163682e706466, '3716.68', 'Counseling Psychology: An Integrated Positive Approach introduces a new dimension in counseling psychology which includes both symptom treatment and positive psychology; this unique approach guides readers to enhance clients’ positive potential, rather than focusing solely on the treatment of clients’ negative symptoms.', 'Psychology', '2021-06-03 22:18:25.712000', '2021-06-03 22:18:25.712000'),
(88, 'Dark Psychology: The Practical Uses and Best Defenses of Psychological Warfare in Everyday Life - Ho', 'James W. Williams', 'Dark Psychology.jpg', 0x4461726b2050737963686f6c6f67792e706466, '160.90', 'Dark psychology has always been discussed in hushed tones and there is still so much information out there that has gotten lost in barely understandable psychobabble that leaves you more perplexed than informed. This book does an effective job of demystifying dark psychology and equips you with the knowledge that you can use to protect yourself against it.', 'Psychology', '2021-06-03 22:19:02.128000', '2021-06-03 22:19:02.128000'),
(89, 'How Psychology Works: Theories and Therapies for Everyday Life', 'Laurence Bouvard', 'How Psychology Works.jpg', 0x486f772050737963686f6c6f677920576f726b732e706466, '1019.00', 'Explore the human mind and understand the science behind how you and other people in your life think and act in a wide range of everyday situations with this brand new visual guide to applied psychology. Clear and easy to understand for both students and readers with a general interest, this book explores and explains the various approaches that psychologists use to study how people think and behave, such as behaviorism, cognitive psychology, and humanism. It also shows how these approaches can be applied to real-world situations, with examples from the workplace to the sports field, the courtroom to the classroom. Learn why psychology plays a huge role in all of our lives and develop a greater understanding of what influences our behavior, thoughts and feelings, and those of others, in a variety of environments and scenarios.', 'Psychology', '2021-06-03 22:19:33.265000', '2021-06-03 22:19:33.265000'),
(90, 'Psychology and Crime: An Introduction to Criminological Psychology', 'Clive R. Hollin', 'Psychology and Crime An Introduction to Criminological Psychology.jpg', 0x50737963686f6c6f677920616e64204372696d6520416e20496e74726f64756374696f6e20746f204372696d696e6f6c6f676963616c2050737963686f6c6f67792e706466, '2701.82', 'Crime is an expensive aspect of society, and each year huge amounts of public money are spent on the courts, police, probation services, and prisons, while the human costs in terms of pain, fear and loss is incalculable. Psychology and Crime comprehensively covers the vital role of psychological theories and methods in understanding and managing criminal behavior. It analyzes in depth the application of psychological findings to a range of serious crimes, such as arson, violent crime, and sexual crime. It examines the use of psychology by the police and the courts and discusses the role of psychology in crime reduction strategies.', 'Psychology', '2021-06-03 22:20:18.108000', '2021-06-03 22:20:18.108000'),
(91, 'The Philosophy of Psychology', 'George Botterill, Peter Carruthers', 'The Philosophy Of Psychology.jpg', 0x546865205068696c6f736f706879204f662050737963686f6c6f67792e706466, '1818.81', 'This book presents an original and accessible analysis of the relationship between common-sense, or ''folk'', psychology and contemporary scientific psychology, focusing on the ways in which cognitive science presents a challenge to our common-sense self-image. It is designed as a textbook for upper-level undergraduate and beginning postgraduate students in philosophy and cognitive science, but as a text that not only surveys but advances the debates on the topics discussed, it will also be of interest to researchers working in these areas.', 'Psychology', '2021-06-03 22:21:00.902000', '2021-06-03 22:21:00.902000'),
(92, 'The Psychology of Self-Esteem: A Revolutionary Approach to Self-Understanding that Launched a New Er', 'Nathaniel Branden', 'The Psychology Of Self-Esteem.jpg', 0x5468652050737963686f6c6f6779204f662053656c662d45737465656d2e706466, '1052.79', 'This new edition of the original text reveals how Nathaniel Branden''s landmark book broke the rules of conventional behavioral theory and promulgated his revolutionary ideas on the critical role that self-esteem plays in living a healthy, fulfilling life. The book offers an in-depth exploration of the need for self-esteem, the nature of that need, the conditions of fulfillment, and how self-esteem (or lack of it) affects our values, responses, and goals. Branden also debunks the misguided notion that self-esteem is a "feel-good phenomenon" and shows instead how self-esteem, rationality, perseverance, self-responsibility, and personal integrity is all intimately related.', 'Psychology', '2021-06-03 22:21:31.037000', '2021-06-03 22:21:31.037000'),
(93, 'Big Data and Social Science: A Practical Guide to Methods and Tools', 'Ian Foster, Rayid Ghani, Ron S. Jarmin, Frauke Kreuter, Julia Lane', 'Big Data and Social Science.jpg', 0x426967204461746120616e6420536f6369616c20536369656e63652e706466, '2129.09', 'Big Data and Social Science: A Practical Guide to Methods and Tools shows how to apply data science to real-world problems in both research and the practice. The book provides practical guidance on combining methods and tools from computer science, statistics, and social science. This concrete approach is illustrated throughout using an important national problem, the quantitative study of innovation. The text draws on the expertise of prominent leaders in statistics, the social sciences, data science, and computer science to teach students how to use modern social science research principles as well as the best analytical and computational tools. It uses a real-world challenge to introduce how these tools are used to identify and capture appropriate data, apply data science models and tools to that data, and recognize and respond to data errors and limitations.', 'Social and Behavioral Science', '2021-06-03 22:22:21.070000', '2021-06-03 22:22:21.070000'),
(94, 'Behavioral Science 7th Edition', 'Barbara Fadem', 'Behavioral Science 7th Edition.jpg', 0x4265686176696f72616c20536369656e6365203774682045646974696f6e2e706466, '1675.66', 'Prepare for success on the USMLE with this up-to-date resource! Offering current coverage of behavioral science, psychiatry, epidemiology, and related courses, this review book prepares you to rapidly recall key information on the mind-body relationship, and apply that knowledge on the day of the exam. Hundreds of USMLE-style questions with detailed answers and explanations help you prepare.', 'Social and Behavioral Science', '2021-06-03 22:22:57.165000', '2021-06-03 22:22:57.165000'),
(95, 'Captivate: The Science of Succeeding with People', 'Vanessa Van Edwards', 'Captivate The Science of Succeeding with People.jpg', 0x4361707469766174652054686520536369656e6365206f662053756363656564696e6720776974682050656f706c652e706466, '575.94', 'As a human behavior hacker, Vanessa Van Edwards created a research lab to study the hidden forces that drive us. And she’s cracked the code. In Captivate, she shares shortcuts, systems, and secrets for taking charge of your interactions at work, at home, and in any social situation. These aren’t the people skills you learned in school. This is the first comprehensive, science backed, real life manual on how to captivate anyone—and a completely new approach to building connections.', 'Social and Behavioral Science', '2021-06-03 22:23:33.995000', '2021-06-03 22:23:33.995000'),
(96, 'Evolve Your Brain: The Science of Changing Your Mind', 'Joe Dispenza', 'Evolve Your Brain  The Science of Changing Your Mind.jpg', 0x45766f6c766520596f757220427261696e202054686520536369656e6365206f66204368616e67696e6720596f7572204d696e642e706466, '499.02', 'With the dynamic combination of science and accessible how-to, Dispenza teaches how to use the most important tool in one’s body and life—the brain. Dispenza touched upon the brain''s ability to become addicted to negative emotions. Now, in his empowering book Evolve Your Brain he explains how new thinking and new beliefs can literally rewire one''s brain to change behavior, emotional reactions, and habit forming patterns. Most people are unaware of how addicted they are to their emotions, and how the brain perpetuates those addictions automatically. In short, we become slaves to our emotional addictions without even realizing it. By observing our patterns of thought, and learning how to ''re-wire the brain'' with new thought patterns, we can break the cycles that keep us trapped and open ourselves to new possibilities for growth, happiness and emotional satisfaction.', 'Social and Behavioral Science', '2021-06-03 22:24:09.276000', '2021-06-03 22:24:09.276000'),
(97, 'Philosophy of Social Science: The Philosophical Foundations of Social Thought', 'Ted Benton, Ian Craib', 'Philosophy of Social Science The Philosophical Foundations of Social Thought.jpg', 0x5068696c6f736f706879206f6620536f6369616c20536369656e636520546865205068696c6f736f70686963616c20466f756e646174696f6e73206f6620536f6369616c2054686f756768742e706466, '1890.62', 'Philosophers and social scientists share a common goal: to explore fundamental truths about ourselves and the nature of the world in which we live. But in what ways do these two distinct disciplines inform each other and arrive at these truths? The 10th anniversary edition of this highly regarded text directly responds to such issues as it introduces students to the philosophy of social science. While staying true to the writing of the late Ian Craib, this perennial text has been brought up to date by Ted Benton. This new edition includes previously unpublished personal insights from both authors, incorporates new commentaries on classic content and features an additional chapter on recent developments in the field.', 'Social and Behavioral Science', '2021-06-03 22:24:47.391000', '2021-06-03 22:24:47.391000'),
(98, 'Social Engineering: The Science of Human Hacking', 'Christopher Hadnagy', 'Social Engineering The Science of Human Hacking.jpg', 0x536f6369616c20456e67696e656572696e672054686520536369656e6365206f662048756d616e204861636b696e672e706466, '1190.70', 'Social Engineering: The Science of Human Hacking reveals the craftier side of the hacker’s repertoire—why hack into something when you could just ask for access? Undetectable by firewalls and antivirus software, social engineering relies on human fault to gain access to sensitive spaces; in this book, renowned expert Christopher Hadnagy explains the most commonly-used techniques that fool even the most robust security personnel, and shows you how these techniques have been used in the past. The way that we make decisions as humans affects everything from our emotions to our security. Hackers, since the beginning of time, have figured out ways to exploit that decision making process and get you to take an action not in your best interest. This new Second Edition has been updated with the most current methods used by sharing stories, examples, and scientific study behind how those decisions are exploited.', 'Social and Behavioral Science', '2021-06-03 22:25:40.758000', '2021-06-03 22:25:40.758000'),
(99, 'Backyard Poultry Medicine and Surgery: A Guide for Veterinary Practitioners', 'Cheryl B. Greenacre and Teresa Y. Morishita', 'Backyard Poultry Medicine and Surgery.jpg', 0x4261636b7961726420506f756c747279204d65646963696e6520616e6420537572676572792e706466, '3928.96', 'Backyard Poultry Medicine and Surgery is a practical resource offering guidance on developing diagnostic and treatment plans for individual companion poultry or small flocks. Organized by body system to aid in developing a differential diagnosis list for common presenting signs, the book provides all the information clinicians need to effectively treat backyard poultry. Written by experts from both the commercial poultry field and the companion avian field, the book provides thorough coverage of both common and less common diseases of backyard chickens, ducks, and other poultry. The book begins with introductory chapters covering general information, an overview of US laws, and basic husbandry concerns, then moves into specific disease chapters organized by system. The book takes an individual medicine perspective throughout, with photographs, radiographs, and histopathological photomicrographs to illustrate principles and diseases. Backyard Poultry Medicine and Surgery is an invaluabl', 'Veterinary Medicine', '2021-06-03 22:26:16.674000', '2021-06-03 22:26:16.674000'),
(100, 'Clinical Veterinary Medicine', 'Mel Roth', 'Clinical Veterinary Medicine.jpg', 0x436c696e6963616c205665746572696e617279204d65646963696e652e706466, '6311.54', 'This book explores all the important aspects of veterinary medicine in the present day scenario as well as its future prospects. It aims to shed light on some of the unexplored areas and recent researches of this discipline. Veterinary medicine primarily deals with prevention, diagnosis and treatment of diseases in animals. It also helps to prevent the spread of diseases from animals to human beings. Different approaches, evaluations, methodologies, and advanced studies have been included in this book. It will prove to be immensely beneficial to veterinary doctors, par veterinary workers, students and researchers in this field.', 'Veterinary Medicine', '2021-06-03 22:27:00.735000', '2021-06-03 22:27:00.735000'),
(101, 'Large Animal Medicine for Veterinary Technicians', 'Laura Lien, Sue Loly, and Sheryl Ferguson', 'Large Animal Medicine for Veterinary Technicians.jpg', 0x4c6172676520416e696d616c204d65646963696e6520666f72205665746572696e61727920546563686e696369616e732e706466, '3294.50', 'This comprehensive guide to all aspects of caring for horses, cattle, camelids, small ruminants, and pigs helps veterinary technician students learn everything they need to know about large animal medicine. Presented in full-color, Large Animal Medicine for Veterinary Technicians provides species-specific coverage with a wealth of images, as well as clinical applications. Coverage includes AVMA-required topics such as hospital biosecurity, restraint, physical examinations, nutrition, clinical and diagnostic procedures, reproduction, neonatology, and disease. To reinforce the text, an accompanying website offers review questions and answers, case studies, and an image bank with additional photographs to aid in breed identification. Veterinary technician students, veterinary technician educators, and veterinary technicians in practice who wish to foster and expand their knowledge of large animal medicine will find Large Animal Medicine for Veterinary Technicians an invaluable resource.', 'Veterinary Medicine', '2021-06-03 22:27:32.939000', '2021-06-03 22:27:32.939000'),
(102, 'Manual of Small Animal Emergency and Critical Care Medicine', 'Douglass K. Macintire, Kenneth J. Drobatz, Steven C. Haskins, and William D. Saxon ', 'Manual of Small Animal Emergency and Critical Care Medicine.jpg', 0x4d616e75616c206f6620536d616c6c20416e696d616c20456d657267656e637920616e6420437269746963616c2043617265204d65646963696e652e706466, '648.84', 'Blackwell Publishing has acquired 85 titles from LWW''s veterinary medicine book list. To place an order or get additional product information go to www.blackwellpublishing.com/vet. This manual provides clear, concise management advice from a team of leaders in emergency veterinary medicine, making it a valuable text for the classroom and an indispensable resource for emergency situations in daily veterinary practice. Written in an easy-to-follow outline format, this book gives you rapid access to essential information needed to stabilize and treat the emergency and critical care patient. The first part of the book outlines initial care of the trauma or critical patient, followed by coverage that ranges from triage to basic fluid therapy, monitoring, and continuous care. The second part of the book features emergency care coverage organized by body system, beginning with the general approach to patients with emergent signs in.', 'Veterinary Medicine', '2021-06-03 22:28:19.141000', '2021-06-03 22:28:19.141000'),
(103, 'Modern Parasitology: A TEXTBOOK OF PARASITOLOGY', 'F. E. G. Cox', 'Modern Parasitology.jpg', 0x4d6f6465726e20506172617369746f6c6f67792e706466, '4546.17', 'This is a thorough revision and update of the highly successful first edition, which achieved sales in excess of 4,500. The text serves as a comprehensive introduction to parasitology for both undergraduate and beginning graduate students. In this edition, particular emphasis is placed on parasites of human and veterinary importance. The first three chapters in the text are concerned with how parasites ''work,'' their biochemistry, molecular and cell biology and physiology. The remaining chapters cover ecology and epidemiology, immunology and chemotherapy, with the final chapter covering integrated control. This new edition contains new material on cell and molecular biology, vectors and control, which is in contrast to the general biological approach of the first edition. The second edition will succeed the first as the major text on parasitology for students in biology, zoology, microbiology, medicine, veterinary medicine, tropical medicine and public health.', 'Veterinary Medicine', '2021-06-03 22:29:03.105000', '2021-06-03 22:29:03.105000'),
(104, 'Veterinary Herbal Medicine', 'Susan G. Wynn and Barbara J. Fougère', 'Veterinary Herbal Medicine.jpg', 0x5665746572696e6172792048657262616c204d65646963696e652e706466, '7413.22', 'This full-color reference offers practical, evidence-based guidance on using more than 120 medicinal plants, including how to formulate herbal remedies to treat common disease conditions. A body-systems based review explores herbal medicine in context, offering information on toxicology, drug interactions, quality control, and other key topics.', 'Veterinary Medicine', '2021-06-03 22:29:35.173000', '2021-06-03 22:29:35.173000'),
(105, 'The Horse', 'William Youatt', 'The Horse.jpg', 0x54686520486f7273652e706466, '5211.00', 'From the metamorphosis of a caterpillar to a butterfly to the life cycle of a wood frog, detailed photographs of plant and animal development, paired with concise text, introduce young readers to life cycles. Whether it is a life cycle of a maple tree or a chicken, readers will find that each share basic needs for food, water, light, and air.', 'Veterinary Medicine', '2021-06-12 17:30:00.864000', '2021-06-12 17:30:00.864000');
INSERT INTO `books_table` (`BOOK_ID`, `BOOK_TITLE`, `BOOK_AUTHOR`, `BOOK_COVER`, `BOOK_FILE`, `BOOK_PRICE`, `BOOK_DESC`, `BOOK_CATEGORY`, `BOOK_CREATED_DATE`, `BOOK_MODIFIED_DATE`) VALUES
(106, 'Plumb’s Veterinary Drug Handbook 7th Edition', 'Donald C. Plumb', 'plumb’s-veterinary-drug-handbook-7th-edition.jpg', 0x506c756d622773205665746572696e61727920447275672048616e64626f6f6b2c2037652e706466, '1233.00', 'Providing referenced dosing recommendations in each monograph, this book offers doses for a wide range of species, including dogs, cats, exotic animals, and farm animals, in a single resource. The book also includes detail on key aspects for appropriate use of each drug, including pharmacology, pharmacokinetics, contraindications, adverse effects, safety during pregnancy or nursing, overdoses, drug interactions, monitoring, chemistry and stability, storage, compatibility, and available products. The seventh edition adds 22 new drug monographs, as well as updated dosages and information for existing drugs. A noteworthy feature is the Prescriber Highlights section found at the beginning of each monograph that allows readers a quick method of finding important information for that drug.', 'Veterinary Medicine', '2021-06-12 20:25:04.932000', '2021-06-12 20:26:11.919000'),
(107, 'Miller’s Anatomy of the Dog 4th Edition', 'Alexander de Lahunta', 'millers-anatomy-of-the-dog-4th-edition1.jpg', 0x4d696c6c6572e280997320416e61746f6d79206f662074686520446f672e706466, '4300.00', 'Miller’s Anatomy of the Dog features unparalleled coverage of canine morphology, with detailed descriptions and vivid illustrations that make intricate details easier to see and understand. Updated content reflects the latest knowledge on development, structure, and function, making this a valuable reference for anatomists, veterinary students, technicians, clinicians, experimentalists, and breeders. It is also useful in specialty fields such as mammalogy, biomechanics, and archaeology.', 'Veterinary Medicine', '2021-06-12 20:32:44.122000', '2021-06-12 20:32:44.122000'),
(108, 'Blackwell’s Five-minute Veterinary Consult Canine and Feline 6th Edition', 'Wiley Blackwell', 'blackwell’s-five-minute-veterinary-consult-canine-and-feline-6th-edition.jpg', 0x426c61636b77656c6ce280997320466976652d4d696e757465205665746572696e61727920436f6e73756c742043616e696e6520616e642046656c696e652c203665202832303135292e706466, '3200.00', 'Blackwell’s Five-minute Veterinary Consult Canine and Feline 6th Edition having a trusted clinician with you in the exam room, the fully updated Sixth Edition of Blackwell’s Five-Minute Veterinary Consult Canine and Feline continues to offer fast access to information in an easy-to-use format.\r\n\r\nProvides fast access to key information on the diagnosis and treatment of diseases and conditions in dogs and cats\r\nCovers 846 specific disorders, making it the most comprehensive quick-reference book on canine and feline medicine\r\nCarefully designed for fast searching and reference in the busy practice setting, giving you the confidence to make clinical decisions quickly and appropriately\r\nPresents contributions from 379 leading experts specializing in all areas of veterinary medicine\r\nIncludes access to a companion website with 354 client education handouts for you to download and use in practice, plus images and video clips..', 'Veterinary Medicine', '2021-06-12 20:36:26.200000', '2021-06-12 20:37:00.700000'),
(109, 'Performing the Small Animal Physical Examination', 'Ryane E. Englar', 'performing-the-small-animal-physical-examination.jpg', 0x506572666f726d696e672074686520536d616c6c20416e696d616c20506879736963616c204578616d696e6174696f6e2e706466, '290.00', 'Performing the Small Animal Physical Examination is one of The Best Veterinary Books Online and offers an easy-to-follow guide to successfully executing a thorough physical exam in cats and dogs, with nearly 1,000 clinical photographs depicting step-by-step details.\r\n\r\nProvides comprehensive, practical information on the physical examination in small animal patients\r\nPresents nearly 1,000 color photographs with step-by-step details of the procedures and principles\r\nOffers advice on preparing the examination room, useful tips, and concrete guidance for examining each body system\r\nOutlines a systematic, in-depth approach to the initial examination in dogs and cats\r\nSupports new and experienced veterinarians and veterinary technicians alike in performing a thorough basic exam', 'Veterinary Medicine', '2021-06-12 20:40:06.804000', '2021-06-12 20:40:06.804000'),
(110, 'Problem Based Feline Medicine', 'Jacqule Rand', 'problem-based-feline-medicine.jpg', 0x50726f626c656d2d42617365642046656c696e65204d65646963696e652e706466, '7200.00', 'This focused resource covers all medical conditions that affect cats. Using a unique problem-based approach, provides essential information for assessing presenting symptoms, reaching a differential diagnosis, and selecting the appropriate course of treatment for feline patients. A consistent format makes it easy to find information related to key signs and possible causative factors (graded to indicate how common each is), diagnosis, differential diagnosis (including tests where appropriate), treatment, prognosis, and prevention (where applicable) for each clinical condition.]\r\n\r\nConcise, logical format makes this resource ideal for quick reference in the clinical setting.\r\nCovers every condition likely to be encountered in cats worldwide.\r\nFeatures a strong international contributor list of feline experts from North America, the UK, Europe, and Australia', 'Veterinary Medicine', '2021-06-12 20:44:16.675000', '2021-06-12 20:44:16.675000'),
(111, 'An Illustrated Guide to Veterinary Medical Terminology', 'Janet Romich', 'an-illustrated-guide-to-veterinary-medical-terminology-3rd-edition.jpg', 0x416e20496c6c75737472617465645f477569646520746f205665746572696e617279207465726d696e6f6c6f6779203372642065646974696f6e2e706466, '1200.00', 'An Illustrated Guide to Veterinary Medical Terminology, Third Edition provides a visual approach to learning medical terms and understanding the basics of veterinary medicine. A systematic process of breaking down medical terms into their parts allows readers to comprehend the root medical concepts and apply critical thinking skills when faced with new and unfamiliar medical terminology. Chapters progress from basic terminology related to anatomical positioning to body systems, and then to species-specific terminology. Case studies exemplify how medical terminology would be experienced in actual veterinary practice.', 'Veterinary Medicine', '2021-06-12 20:49:19.036000', '2021-06-12 20:49:19.036000'),
(112, 'A Plague of People', 'John Robinson', 'A Plague of People.jpg', 0x612d706c616775652d6f662d70656f706c652e706466, '1211.00', 'People fill every part of the planet, using all resources and driving other species to extinction, until further expansion is impossible. The process and consequences are fully explored here with a science-based forecast of a complete collapse by 2030. The culture change urgently required is refused by a kamikaze culture of growth controlled by a foolhardy powerful minority.', 'Social and Behavioral Science', '2021-06-12 21:06:31.927000', '2021-06-12 21:06:31.927000'),
(113, 'Social Science Research: Principles, Methods, and Practices', 'by Anol Bhattacherjee', 'Social Science Research Principles, Methods, and Practices.jpg', 0x536f6369616c20536369656e63652052657365617263685f205072696e6369706c6573204d6574686f647320616e64205072616374696365732e706466, '2000.00', 'This book is designed to introduce doctoral and graduate students to the process of scientific research in the social sciences, business, education, public health, and related disciplines. It is a one-stop, comprehensive, and compact source for foundational concepts in behavioral research, and can serve as a stand-alone text or as a supplement to research readings in any course on research methods.', 'Social and Behavioral Science', '2021-06-12 21:07:35.212000', '2021-06-12 21:07:35.212000'),
(114, 'Investing in Young Children for Peaceful Societies', 'National Academies Press 2016', 'Investing in Young Children for Peaceful Societies.jpg', 0x496e76657374696e6720696e20596f756e67204368696c6472656e20666f7220506561636566756c20536f636965746965732e706466, '4000.00', 'Researchers, policy makers, program practitioners, funders, youth, and other experts came together to understand the effects of conflict and violence on children, women, and youth across areas of health, education, nutrition, social protection, and other domains. The goal of the workshop was to continue to fill in gaps in knowledge and explore opportunities for discourse through a process of highlighting the science and practice.', 'Social and Behavioral Science', '2021-06-12 21:08:25.245000', '2021-06-12 21:08:25.245000'),
(115, 'Wellbeing, Freedom and Social Justice: The Capability Approach Re-Examined', 'Ingrid Robeyns', 'Wellbeing, Freedom and Social Justice The Capability Approach Re-Examined.jpg', 0x57656c6c6265696e672d46726565646f6d2d536f6369616c2d4a7573746963652e706466, '2300.00', 'How do we evaluate ambiguous concepts such as wellbeing, freedom, and social justice? How do we develop policies that offer everyone the best chance to achieve what they want from life? The capability approach, a theoretical framework pioneered by the philosopher and economist Amartya Sen in the 1980s, has become an increasingly influential way to think about these issues.', 'Social and Behavioral Science', '2021-06-12 21:09:00.638000', '2021-06-12 21:09:00.638000'),
(116, 'On the Dual Uses of Science and Ethics', 'Brian Rappert, Michael J. Selgelid (eds', 'On the Dual Uses of Science and Ethics.jpg', 0x4f6e20746865204475616c2055736573206f6620536369656e636520616e64204574686963732e706466, '4100.00', 'Claims about the transformations enabled by modern science and medicine have been accompanied by an unsettling question in recent years: might the knowledge being produced undermine -- rather than further -- human and animal well-being.', 'Social and Behavioral Science', '2021-06-12 21:09:57.953000', '2021-06-12 21:09:57.953000'),
(117, 'A Beginner''s Psychology', 'A Beginner''s Psychology', 'A Beginner''s Psychology.jpg', 0x4120426567696e6e657227732050737963686f6c6f67792e706466, '2200.00', 'I have tried to write, as nearly as might be, the kind of book that I should have found useful when I was beginning my own study of psychology. I lay less stress upon knowledge and more upon point of view. I shall be fully satisfied if the reader learns to be clear and definite in his objections, realizes his own point of view, and sticks to it in working out later his own psychological system', 'Psychology', '2021-06-12 21:35:44.824000', '2021-06-12 21:35:44.824000'),
(118, 'Formulation in Action: Applying Psychological Theory to Clinical Practice', 'David Dawson, Nima Moghaddam', 'Formulation in Action Applying Psychological Theory to Clinical Practice.jpg', 0x466f726d756c6174696f6e20696e20416374696f6e204170706c79696e672050737963686f6c6f676963616c205468656f727920746f20436c696e6963616c2050726163746963652e706466, '2150.00', 'When people seek psychological support, the formulation is the theory-driven methodology used by many practitioners to guide the identification of the processes, mechanisms, and patterns of behavior that appear to be contributing to the presenting difficulties. In this volume, we present multiple demonstrations of formulation in action -- written by applied psychologists embedded in clinical training, research, and practice.', 'Psychology', '2021-06-12 21:36:45.541000', '2021-06-12 21:36:45.541000'),
(119, 'Together:The Science of Social Psychology', 'Robert Biswas-Diener, Edward Diener', 'Together the Science of Social Psychology.jpg', 0x546f6765746865722054686520536369656e6365206f6620536f6369616c2050737963686f6c6f67792e706466, '2500.00', 'The science of social psychology investigates the ways other people affect our thoughts, feelings, and behaviors. It is an exciting field of study because it is so familiar and relevant to our day-to-day lives. Social psychologists study a wide range of topics that can roughly be grouped into 5 categories: attraction, attitudes, peace and conflict, social influence, and social cognition.', 'Psychology', '2021-06-12 21:37:20.310000', '2021-06-12 21:37:39.103000'),
(120, 'Emotional Intelligence and Cognitive Abilities', 'Puri Checa, Pablo Fernandez-Berrocal', 'Emotional Intelligence and Cognitive Abilities.jpg', 0x456d6f74696f6e616c20496e74656c6c6967656e636520616e6420436f676e6974697665204162696c69746965732e504446, '2250.00', 'Nowadays, not only psychologists are interested in the study of Emotional Intelligence (EI). Teachers, educators, managers, employers, and people in general pay attention to EI. EI is broadly defined as the capacity to process and use emotional information.', 'Psychology', '2021-06-12 21:41:04.237000', '2021-06-12 21:41:04.237000'),
(121, 'Early and late selection: Effects of load, dilution and salience', 'Tal Makovski, Glyn Humphreys, Bernhard Hommel', 'Early and late selection Effects of load, dilution and salience.jpg', 0x4561726c7920616e64206c6174652073656c656374696f6e202d2045666665637473206f66206c6f61642c2064696c7574696f6e20616e642073616c69656e63652e504446, '1444.00', 'Our visual system is constantly bombarded by a variety of stimuli, of which only a small part is relevant to the task at hand. As a result, goal-directed behavior requires a high degree of selectivity at some point in the processing stream. The precise point at which selection takes place has been the focus of much debate.', 'Psychology', '2021-06-12 21:42:25.504000', '2021-06-12 21:42:25.504000'),
(122, 'A Manual Of Land Surveying', 'F. Hodgman', 'A Manual Of Land Surveying.jpg', 0x6d616e75616c6f666c616e64737572763030686f6467726963682e706466, '5840.00', 'This addition to the already numerous treatises on land surveying was caused by the demand of the surveyors of Michigan for a treatise that would deal with the practical questions which meet the surveyor in his everyday work in the field.', 'Physical Science and Engineering', '2021-06-12 21:59:46.120000', '2021-06-12 21:59:46.120000'),
(123, 'Traditional and Innovative Approaches in Seismic Design', 'Linda Giresini, Francesca Taddei (eds)', 'Traditional and Innovative Approaches in Seismic Design.jpg', 0x547261646974696f6e616c5f616e645f496e6e6f7661746976655f417070726f61636865735f696e5f536569736d69635f44657369676e2e706466, '1700.00', 'This special issue collects selected papers about a wide range of innovative applications in earthquake engineering. The topics refer to the investigation of traditional and innovative materials for earthquake engineering applications: masonry, reinforced concrete, steel, structural glass, and timber.', 'Physical Science and Engineering', '2021-06-12 22:02:40.657000', '2021-06-12 22:02:40.657000'),
(124, 'Fundamentals of Combustion', 'Joseph M. Powers', 'Fundamentals of Combustion.jpg', 0x46756e64616d656e74616c73206f6620436f6d62757374696f6e2e706466, '4100.00', 'Thermodynamics and chemical kinetics of combustion reactions, modeling of reacting fluid mechanical systems, subsonic and supersonic combustion, detailed and one-step kinetics, ignition theory, asymptotic and numerical techniques for modeling combustion systems.', 'Physical Science and Engineering', '2021-06-12 22:03:16.132000', '2021-06-12 22:03:16.132000'),
(125, 'Fundamentals of Die Casting Design', 'Genick Bar-Meir', 'Fundamentals of Die Casting Design.jpg', 0x46756e64616d656e74616c73206f66204469652043617374696e672044657369676e2e706466, '1850.00', 'This book describes the fundamentals of design of the die casting process and dies mold/runner. It is intended for people who have at least some knowledge of the basics of fundamental science, such as calculus, physics, etc. This book will benefit the die casting engineer (the project and process engineers) as well as managers and anyone else who deals with the die casting operations will find this information useful.', 'Physical Science and Engineering', '2021-06-12 22:04:18.376000', '2021-06-12 22:04:18.376000'),
(126, 'Isometric Drawing', 'Alpha Pierce Jamison', 'Isometric Drawing.jpg', 0x49736f6d65747269632044726177696e672e6a7067, '920.00', 'To understand what is to follow, the reader must possess a working knowledge of mechanical drawing. Attention is to be given to how a drawing can be made, rather than to the reasons for doing ''thus and so''. Plain and common terms will be used.', 'Physical Science and Engineering', '2021-06-12 22:07:47.577000', '2021-06-12 22:07:47.577000'),
(127, 'Advanced Nursing Practice', 'Madrean Schober', 'Advanced Nursing Practice.jpeg', 0x496e7465726e6174696f6e616c20436f756e63696c206f66204e757273657320416476616e636564204e757273696e672050726163746963652e706466, '1350.00', 'Advanced Nursing Practice addresses the key issues in practice, education, regulation, research, and role/practice development, which are central to defining the distinctive nature of the advanced nursing practice (ANP) and explores international developments in the field of ANP. Advanced Nursing Practice has been developed in recognition of the key role nurses with advanced knowledge and skills play in developing health care services worldwide. The book tracks the evolution of new advanced practice nursing roles and innovative practice models and examines the need for international guidelines. In exploring strategies for implementing ANP in the context of countries'' health care needs, Advanced Nursing Practice addresses legal and ethical challenges and commonalities and differences in advanced nursing practice, while examining the implications, obstacles, and facilitative strategies in maintaining, implementing, and supporting the development of ANP. ', 'Nursing, Dentistry, and Healthcare', '2021-06-13 11:55:35.273000', '2021-06-13 11:55:35.273000'),
(128, 'Clinical Teaching Strategies in Nursing 3rd edition', 'K. Gaberson, M. Oermann ', 'clinical-teaching-strategies-in-nursing-3rd-ed-k-gaberson-m-oermann-2010-210x315.jpeg', 0x436c696e6963616c205465616368696e67205374726174656769657320696e204e757273696e6720337264206564202d204b2e204761626572736f6e204d2e204f65726d616e6e202832303130292e706466, '2010.00', 'This textbook presents a comprehensive framework for planning, guiding, and evaluating learning activities for undergraduate and graduate nursing students in clinical settings.nThe book presents clinical teaching strategies that are effective and practical in a rapidly changing health care environment. It describes a range of teaching strategies useful for courses in which the teacher is on-site with students, in courses using preceptors, in simulation laboratories, and in distance education environments.nThis book represents the cutting edge of educational strategies, examining innovative uses of virtual reality, game-based learning, and nontraditional sites for clinical teaching. Also discussed are culturally inclusive strategies, methods incorporating current technologies, and strategies for teaching students with disabilities', 'Nursing, Dentistry, and Healthcare', '2021-06-13 11:58:05.635000', '2021-06-13 11:58:05.635000'),
(129, 'Clinical Drug Therapy: Rationales for Nursing Practice, Ninth Edition 9th Edition', 'Anne Collins Abrams ', 'clinical-drug-therapy-rationales-for-nursing-practice-ninth-edition-9th-edition-210x315.jpeg', 0x436c696e6963616c20447275672054686572617079202d20526174696f6e616c657320666f72204e757273696e67205072616374696365203974682065642e202d20412e20416272616d732065742e20616c2e202832303037292e706466, '2700.00', 'This popular core nursing pharmacology textbook provides unique coverage of nursing interventions for drug therapy with related rationales. Highly praised for its organized, readable presentation, the text explains the "why" behind each nursing action and emphasizes how drugs work differently in different patients. Highlights of the Ninth Edition include new Evidence-Based Practice displays, clearly identified FDA Black Box Warnings, case studies threaded through each drug chapter, key terms with definitions in chapter openers, a comprehensive glossary, a revised art program, and thoroughly revised end-of-chapter NCLEX®-style questions.', 'Nursing, Dentistry, and Healthcare', '2021-06-13 12:00:16.957000', '2021-06-13 12:00:16.957000'),
(130, 'Delmars Fundamental & Advanced Nursing Skills ', 'Gayle Bouska Altman', 'delmars-fundamental-advanced-nursing-skills-g-altman-210x315.jpeg', 0x44656c6d6172732046756e64616d656e74616c202620416476616e636564204e757273696e6720536b696c6c73202d20472e20416c746d616e20657420616c2e202854686f6d736f6e204c6561726e696e672032303030292e706466, '2220.00', 'The third edition of Fundamental and Advanced Nursing Skills equips nurses with the knowledge and abilities they will need to survive and thrive in today''s changing health care environment. With over 800 illustrations, this book comprehensively covers more than 200 nursing skills. Using a straightforward approach, Fundamental and Advanced Nursing Skills, Third Edition provides a great resource for any nurse from the hospital to the home "Delmars Fundamental & Advanced Nursing Skills - G. Altman et al. (Thomson Learning 2000)". ', 'Nursing, Dentistry, and Healthcare', '2021-06-13 12:02:04.449000', '2021-06-13 12:02:04.449000'),
(131, 'Brunner & Suddarth’s Textbook of Medical-Surgical Nursing', 'Janice L Hinkle , Kerry H. Cheever', 'brunner-suddarths-textbook-of-medical-surgical-nursing-brunner-and-suddarths-textbook-of-medical-surgical-210x315.jpeg', 0x486e64626b2e20666f72204272756e6e65722053756464617274687320547874626b2e206f66204d65642e2d537572672e204e757273696e6720313274682065642e202d20532e20536d656c747a6572202832303130292e28696e636f6d706c657465292e706466, '811.21', 'Now in its 12th edition, Brunner and Suddarth''s Textbook of Medical-Surgical Nursing is designed to assist nurses in preparing for their roles and responsibilities in the medical-surgical setting. This leading textbook focuses on physiological, pathophysiological, and psychosocial concepts as they relate to nursing care. Brunner is known for its strong Nursing Process focus and its readability. This edition retains these strengths and incorporates enhanced visual appeal and better portability for students', 'Nursing, Dentistry, and Healthcare', '2021-06-13 12:26:32.421000', '2021-06-13 12:26:32.421000'),
(132, 'THE LOVE ECLIPSE: LOVE IS NOT A FEELING, IT IS A CHOICE', 'EZEKIEL MILLINGA', 'THE LOVE ECLIPSE LOVE IS NOT A FEELING, IT IS A CHOICE.jpg', 0x5448452d4c4f56452d45434c495053452d4c4f56452d49532d4e4f542d412d4645454c494e472d49542d49532d412d43484f4943452e706466, '3280.00', 'Leo Felix is a young man whose life became miserable at the age of five. He grows up as a gambler.', 'Novel', '2021-06-13 13:19:36.102000', '2021-06-13 13:19:36.102000'),
(133, 'Always and Forever', 'S Lucy', 'Always And Forever.jpg', 0x416c776179732d616e642d466f72657665722e706466, '630.00', 'The most unexpected thing that can happen in life is LOVE. We don’t have control over with whom it happens. When Alin and Serbian walk together on the road named LOVE, will their destination be as beautiful as they have imagined or will it be the journey that will be worth remembering?', 'Novel', '2021-06-13 13:21:21.317000', '2021-06-13 13:21:21.317000'),
(134, 'The Coldest Summer', 'Grace Gervas', 'The Coldest Summer.jpg', 0x5468652d436f6c646573742d53756d6d65722d322e706466, '425.00', 'When Kira Jones finally decides to take a six-week summer vacation, her best and only friend, Samantha, drags her into a trip out of California. What awaits in the way is something Kira has never fathomed at all, as her life gets a serious turn. \r\n\r\nShe meets a mysterious ranch owner whom her friend already has eyes for, and Kira finds herself drawn near him in a very strange way', 'Novel', '2021-06-13 13:22:17.673000', '2021-06-13 13:22:17.673000'),
(135, 'Cursed', 'Peter Gray', 'Cursed.jpg', 0x4375727365642e6a7067, '166.00', 'It''s Halloween weekend, and Sara and her friends decide to go out into the wilderness to stay at Blackthorn Campground. When they arrive the campsite is eerily quiet, and the only lodger living there is quite adamant that they should leave. Sara and her friends choose to stay at the campsite, forcing them to face the consequences of their own actions.', 'Novel', '2021-06-13 13:22:55.734000', '2021-06-13 13:22:55.734000'),
(136, 'Sexology', 'Vladimir Antonov', 'Sexology.jpg', 0x5345584f4c4f47592e706466, '460.00', 'This book contains a scientific description of mechanisms and regularities of the development of the reproduction system of human beings, including the embryonic period, childhood, and adolescence. It also contains a thorough description of mechanisms of forming homosexuality of both sexes, using results of relevant experiments on animals as a scientific basis.', 'Medicine', '2021-06-13 13:34:59.949000', '2021-06-13 13:34:59.949000'),
(137, 'Treatments for Seasonal Allergic Rhinitis', 'Joan Glacy et al.', 'Treatments for Seasonal Allergic Rhinitis.jpg', 0x54726561746d656e747320666f7220536561736f6e616c20416c6c6572676963205268696e697469732e706466, '3660.00', 'This review compared the effectiveness and common adverse events of medication classes used to treat seasonal allergic rhinitis (SAR) in adolescents and adults, in pregnant women, and in children. Two independent reviewers performed study selection and data abstraction.', 'Medicine', '2021-06-13 13:35:39.675000', '2021-06-13 13:35:39.675000'),
(138, 'Pathological Bodies: Medicine and Political Culture', 'Corinna Wagner', 'Pathological Bodies Medicine and Political Culture.jpg', 0x506174686f6c6f676963616c20426f64696573204d65646963696e6520616e6420506f6c69746963616c2043756c747572652e706466, '3290.00', 'This book explores the important connections between medicine and political culture that often have been overlooked. In response to the French revolution and British radicalism, political propagandists adopted a scientific vocabulary and medical images for their own purposes.', 'Medicine', '2021-06-13 13:36:24.070000', '2021-06-13 13:36:24.070000'),
(139, 'Innovative Medicine: Basic Research and Development', 'Kazuwa Nakao, Nagahiro Minato, Shinji Uemoto', 'Innovative Medicine Basic Research and Development.jpg', 0x496e6e6f766174697665204d65646963696e652e706466, '3390.00', 'This book helps to understand innovative medicine and to make progress in its realization. The book covers a wide range of topics and is organized into three complementary parts. The first part is basic research for innovative medicine, the second is translational research for innovative medicine, and the third is new technology for innovative medicine.', 'Medicine', '2021-06-13 13:36:57.653000', '2021-06-13 13:36:57.653000'),
(140, 'Emerging Technologies to Promote and Evaluate Physical Activity', 'Dan J Graham, et al.', 'Emerging Technologies to Promote and Evaluate Physical Activity.jpg', 0x456d657267696e6720546563686e6f6c6f6769657320746f2050726f6d6f746520616e64204576616c7561746520506879736963616c2041637469766974792e504446, '1410.00', 'Increasingly, efforts to promote and measure physical activity are achieving greater precision, greater ease of use, and/or greater scope by incorporating emerging technologies. This is significant for physical activity promotion because more precise measurement will allow investigators to better understand where, when, and how physical activity is and is not occurring, thus enabling more effective targeting of particular behavior settings.', 'Medicine', '2021-06-13 13:38:11.630000', '2021-06-13 13:38:11.630000'),
(141, 'Bayesian Field Theory', 'Jorg C. Lemm', 'Bayesian Field Theory.jpg', 0x426179657369616e204669656c64205468656f72792e706466, '2000.00', 'Bayesian field theory denotes a nonparametric Bayesian approach for learning functions from observational data. Based on the principles of Bayesian statistics, a particular Bayesian field theory is defined by combining two models: a likelihood model, providing a probabilistic description of the measurement process, and a prior model, providing the information necessary to generalize from training to non-training data.', 'Mathematics and Statistics', '2021-06-13 13:46:20.691000', '2021-06-13 13:46:20.691000'),
(142, 'Probability and Statistics for Geophysical Processes', 'D. Koutsoyiannis', 'Probability and Statistics for Geophysical Processes.jpg', 0x50726f626162696c69747920616e64205374617469737469637320666f722047656f706879736963616c2050726f6365737365732e706466, '1610.00', 'Topics: The utility of probability; Basic concepts of probability; Elementary statistical concepts; Special concepts of probability theory in geophysical applications; Typical univariate statistical analysis in geophysical processes; Typical distribution functions in geophysics, hydrology, and water resources.', 'Mathematics and Statistics', '2021-06-13 13:47:05.588000', '2021-06-13 13:47:05.588000'),
(143, 'Probability and Mathematical Statistics', 'Prasanna Sahoo', 'Probability and Mathematical Statistics.jpg', 0x50726f626162696c69747920616e64204d617468656d61746963616c20537461746973746963732e706466, '1703.00', 'This book is an introduction to probability and mathematical statistics intended for students already having some elementary mathematical background. It is intended for a one-year junior or senior level undergraduate or beginning graduate-level course in probability theory and mathematical statistics.', 'Mathematics and Statistics', '2021-06-13 13:48:06.707000', '2021-06-13 13:48:06.707000'),
(144, 'A Minimum of Stochastics for Scientists', 'Noel Corngold', 'A Minimum of Stochastics for Scientists.jpg', 0x41204d696e696d756d206f662053746f636861737469637320666f7220536369656e74697374732e706466, '770.00', 'The idea behind the book was to introduce students to the ideas and attitudes that underlie the statistical modeling of physical, chemical, biological systems. These pages contain material the author has tried to convey, in a course given occasionally, to a Caltech audience composed mostly of graduate students.', 'Mathematics and Statistics', '2021-06-13 13:49:00.180000', '2021-06-13 13:49:00.180000'),
(145, 'Topics in Random Matrix Theory', 'Terence Tao', 'Topics in Random Matrix Theory.jpg', 0x546f7069637320696e2052616e646f6d204d6174726978205468656f72792e706466, '3400.00', 'This is a textbook for a graduate course on random matrix theory, inspired by recent developments in the subject. This text focuses on foundational topics in random matrix theory upon which the most recent work has been based.', 'Mathematics and Statistics', '2021-06-13 13:49:36.657000', '2021-06-13 13:49:36.657000'),
(146, 'Biology and its Makers', 'William A. Locy', 'Biology and its Makers.jpg', 0x42696f6c6f677920616e6420497473204d616b6572732e706466, '1514.00', 'In this sketch, the author has attempted to bring under one view the broad features of biological progress and to increase the human interest by writing the story around the lives of the great Leaders. This is an untechnical account of the rise and progress of biology.', 'Life Science', '2021-06-13 14:03:29.352000', '2021-06-13 14:03:29.352000'),
(147, 'An Introduction to Biological Aging Theory', 'Theodore C. Goldsmith', 'An Introduction to Biological Aging Theory.jpg', 0x416e20496e74726f64756374696f6e20746f2042696f6c6f676963616c204167696e67205468656f72792e706466, '330.00', 'This short book provides an overview of biological aging theories including history, current status, major scientific controversies, and implications for the future of medicine. Major topics include human mortality as a function of age, aging mechanisms and processes, the programmed vs. non-programmed aging controversy, empirical evidence on aging, and the feasibility of anti-aging and regenerative medicine.', 'Life Science', '2021-06-13 14:04:22.771000', '2021-06-13 14:04:22.771000'),
(148, 'General Biology', 'Leonas Lancelot Burlingame', 'General Biology.jpg', 0x47656e6572616c2042696f6c6f67792e706466, '1616.00', 'Biology has now reached such development that it comprises a large amount of information and knowledge which is not only of the first practical importance to the layman but is also susceptible of being organized into a coherent set of principles suitable for presentation to the ordinary freshman or to the lay public. This necessarily involves stressing principles rather than factual details and limits discussion to such topics as do not put an undue strain on the reader''s knowledge of related sciences such as physics, chemistry, and geology.', 'Life Science', '2021-06-13 14:05:22.826000', '2021-06-13 14:05:22.826000'),
(149, 'Mass Spectrometry Application in Biology', 'Greg Gorman', 'Mass Spectrometry Application in Biology.jpg', 0x4d6173735f5370656374726f6d657472795f4170706c69636174696f6e5f696e5f42696f6c6f67792e706466, '1252.00', 'Mass spectrometry has become a vital tool for a scientist in exploring how biological systems function and how therapeutic drug intervention impact these systems. This volume will focus on the application of mass spectrometry to biological problems that focus on the advancement of medicine and curing diseases.', 'Life Science', '2021-06-13 14:07:05.454000', '2021-06-13 14:07:05.454000'),
(150, 'Biology for Beginners', 'Truman Jesse Moon', 'Biology for Beginners.jpg', 0x42696f6c6f677920666f7220426567696e6e6572732e706466, '1582.00', 'This text is an attempt to present the fundamental facts of elementary biology as clearly and briefly as a reasonable scientific accuracy will allow. The course emphasizes the fact that biology is a unit science, based on the fundamental idea of evolution rather than a forced combination of portions of botany, zoology, and hygiene.', 'Life Science', '2021-06-13 14:08:42.416000', '2021-06-13 14:08:42.416000'),
(151, 'Handbook of Human Genetic Linkage', 'Joseph Douglas Terwilliger, Jurg Ott', 'Handbook of Human Genetic Linkage.jpg', 0x48616e64626f6f6b206f662048756d616e2047656e65746963204c696e6b6167652e706466, '1221.00', 'This is a practical guide to human linkage analysis, with emphasis on the use of various computer programs. Little theoretical background will be provided. Much of this book consists of detailed instructions on how to carry out linkage analyses such that also novices will be able to successfully complete them.', 'Life Science', '2021-06-13 14:09:51.565000', '2021-06-13 14:09:51.565000'),
(152, 'Agricultural Development: Farmers, Farm Production and Farm , Volume 18Markets', 'Robert Evenson, Prabhu Pingali', 'Agricultural Development; Farmers, Farm Production and Farm Markets; Vol 3 in Handbook of Agricultural Economics; Volume 18 of Handbooks in Economics - North Holland.png', , '500.00', 'Handbooks in Economics - North Holland', 'Agriculture, Aquaculture, and Food Service', '2021-06-13 14:56:37.136000', '2021-06-13 14:56:37.136000'),
(153, 'Aquaculture and Fisheries Biotechnology', 'Rex A. Dunham', 'Aquaculture and Fisheries Biotechnology.png', 0x4171756163756c7475726520616e64204669736865726965732042696f746563686e6f6c6f6779202820504446447269766520292e706466, '650.00', 'Aquaculture is an ancient form of farming \r\ndating back 2000 years or more in China \r\nand to the Roman Empire (Balon, 1995; \r\nDunham et al., 2001). However, only in the \r\nlast few decades has aquaculture grown into \r\na global practice resulting in tremendous \r\nworldwide production. Aquaculture production has enlarged dramatically since the \r\nearly 1980s, and will become increasingly \r\nimportant as demand for fish products \r\nincreases, world harvest by capture fisheries reaches a plateau or declines and human \r\npopulation numbers expand. Aquaculture \r\nnow accounts for 50% of global fish consumption (FAO, 2009). The biomass of fish that can be produced per surface area is much greater than that for terrestrial animals, indicating that aquaculture could be the key for providing global food security.', 'Agriculture, Aquaculture, and Food Service', '2021-06-13 14:59:42.233000', '2021-06-13 14:59:42.233000'),
(154, 'Climate-Smart Agriculture', 'Food and Agriculture Organization of the United Nations (FAO) ', 'Climate-Smart Agriculture Sourcebook - Food and Agriculture.png', 0x436c696d6174652d536d617274204167726963756c7475726520536f75726365626f6f6b202d20466f6f6420616e64204167726963756c747572652e706466, '450.00', 'Enhancing food security while contributing to mitigate climate change and preserving the natural resource \r\nbase and vital ecosystem services requires the transition to agricultural production systems that are more \r\nproductive, use inputs more efficiently, have less variability and greater stability in their outputs, and are more \r\nresilient to risks, shocks and long-term climate variability.', 'Agriculture, Aquaculture, and Food Service', '2021-06-13 15:02:33.348000', '2021-06-13 15:04:19.094000'),
(155, 'Greening the Economy with Agriculture - Food and Agriculture', 'Food and Agriculture Organization of the United Nations (FAO)', 'Greening the Economy with Agriculture - Food and Agriculture.png', 0x477265656e696e67207468652045636f6e6f6d792077697468204167726963756c74757265202d20466f6f6420616e64204167726963756c747572652e706466, '499.00', 'The document includes a series of four working papers seeking to support discussions on the green economy of the United Nations Conference on Sustainable Development (Rio+20) process. The draft papers were presented and discussed at an FAO/OECD Expert Meeting on Greening the Economy with Agriculture (GEA), held in Paris, France, 5-7 September 2011. This formed the basis of the GEA summary presented to, and endorsed by, the 143th Session of the FAO Council in November 2011.', 'Agriculture, Aquaculture, and Food Service', '2021-06-13 15:05:35.093000', '2021-06-13 15:05:35.093000'),
(156, 'Small-scale aquaponic food production - Food and Agriculture', 'Food and Agriculture Organization of the United Nations (FAO) ', 'Small-scale aquaponic food production - Food and Agriculture.png', 0x536d616c6c2d7363616c652061717561706f6e696320666f6f642070726f64756374696f6e202d20466f6f6420616e64204167726963756c747572652e706466, '650.00', 'This technical paper showcases current wisdom in aquaponics, focusing on small-scale production. The publication is divided into nine chapters and nine appendixes, with each chapter dedicated to a specific facet of an aquaponic system. The target audience is agriculture extension agents, aquaculture officers, non-governmental organizations, community organizers, companies and individuals – worldwide. The intention is to bring a general understanding of aquaponics to people who previously may have only known about one aspect, i.e. aquaculture agents without experience in hydroponics, and \r\nvice versa. ', 'Agriculture, Aquaculture, and Food Service', '2021-06-13 15:06:49.047000', '2021-06-13 15:06:49.047000'),
(157, 'Architectural Graphic Standards [Student Edition]', 'Keith E. Hedges', 'Architectural Graphic Standards [Student Edition] ( PDFDrive ).png', 0x4172636869746563747572616c2047726170686963205374616e6461726473205b53747564656e742045646974696f6e5d202820504446447269766520292e706466, '550.00', ' Change has never been more apparent or intense than in the last two decades, as the widespread adoption of technology has prompted significant transformation of the industry. This has had a far-reaching impact not only on the medium in which buildings are designed and constructed, but also on processes, standards, analytics, and ways of delivering professional services. Changes encompass the expansion of project delivery methods and role changes; new building codes and industry practices, which have been extended to include accessibility, sustainability, and building resilience guidelines; new building products and construction methods; and an evolution of new and expanded building information management organizational standards. ', 'Architecture and Planning', '2021-06-13 15:09:22.093000', '2021-06-13 15:09:22.093000'),
(158, 'Architecture Form, Space, and Order (4th edition)', 'Francis D.K. Ching', 'Architecture Form, Space, and Order (4th edition).png', 0x4172636869746563747572652020466f726d2c2053706163652c20616e64204f7264657220283474682065646974696f6e29202820504446447269766520292e706466, '580.55', 'In this fourth edition, major changes consist of the addition of more than two dozen contemporary examples, selected to illustrate the new forms that go beyond the timeless elements of basic statics—the columns, beams, and load-bearing walls of stable constructions that are fixed in time and space. Five more modules have also been added to the electronic component to animate certain design decisions regarding scale and proportion, the type of visual, often subtle judgements that designers face in the development of a project.\r\n', 'Architecture and Planning', '2021-06-13 15:11:30.484000', '2021-06-13 15:11:30.484000'),
(159, 'Interior Color by Design', 'Jonathan Poore', 'Interior Color by Design_ A Design Tool for Architects, Interior Designers, and Homeowners  ( PDFDrive ).png', 0x496e746572696f7220436f6c6f722062792044657369676e5f20412044657369676e20546f6f6c20666f7220417263686974656374732c20496e746572696f722044657369676e6572732c20616e6420486f6d656f776e65727320202820504446447269766520292e706466, '950.60', 'A Design Tool for Architects, Interior Designers, and Homeowners  ', 'Architecture and Planning', '2021-06-13 15:14:52.037000', '2021-06-13 15:14:52.037000'),
(160, 'Structure as Architecture - School of Architecture', 'Andrew W. Charleson', 'Structure as Architecture - School of Architecture.png', 0x53747275637475726520617320417263686974656374757265202d205363686f6f6c206f66204172636869746563747572652e706466, '850.96', 'This book explores the potential of structure, that is beams, columns, frames, struts and other structural members, to enrich architecture. At the most basic level I hope to raise architects’ perception of structure as an integral element of architecture rather than as just an applied technology.', 'Architecture and Planning', '2021-06-13 15:16:45.935000', '2021-06-13 15:16:45.935000'),
(161, 'The Architecture of Light [Second Edition]', 'Sage Russel', 'The architecture of light_ architectural lighting design concepts and techniques. A textbook of procedures and practices for the architect, interior designer and lighting designer .png', , '1999.99', 'Light is truly a designer’s medium. It is among the most powerful tools we have to affect change in how we perceive and experience the environment around us. Light belongs as a controllable tool of space design, just as form, scale, and material do. Light translates vision and it is vision that gives us a substantial portion of our experiences.\r\n', 'Architecture and Planning', '2021-06-13 15:18:58.917000', '2021-06-13 15:18:58.917000'),
(162, 'Getting Things Done: The Art of Stress-Free Productivity', 'David Allen', 'Getting Things Done_ The Art of Stress-Free Productivity ( PDFDrive ).png', 0x47657474696e67205468696e677320446f6e655f2054686520417274206f66205374726573732d467265652050726f647563746976697479202820504446447269766520292e706466, '750.00', 'The book is divided into three parts. Part 1 describes the whole game, providing a brief overview of the system and an explanation of why it’s unique and timely, and then presenting the basic methodologies themselves in their most condensed and basic form. Part 2 shows you how to implement the system. It’s your personal coaching, step by step, on the nitty-gritty application of the models. Part 3 goes even deeper, describing the subtler and more profound results you can expect when you incorporate the methodologies and models into your work and your life.', 'Arts and Applied', '2021-06-13 15:28:24.088000', '2021-06-13 15:28:24.088000'),
(163, 'The Art of Company Valuation and Financial Statement Analysis', 'Nicolas Schmidlin', 'The Art of Company Valuation and Financial Statement Analysis_ A Value Investor''s Guide with Real-life Case Studies ( PDFDrive ).png', 0x54686520417274206f6620436f6d70616e792056616c756174696f6e20616e642046696e616e6369616c2053746174656d656e7420416e616c797369735f20412056616c756520496e766573746f7227732047756964652077697468205265616c2d6c69666520436173652053747564696573202820504446447269766520292e706466, '585.65', 'This book looks at the valuation and financial statement analysis of listed companies. Another suitable title could have been ‘Not another book on company valuation!’ Amazon.com displays more than 5,000 hits for this topic and a further 4,000 hits for financial statement analysis. Why do we need another book on this subject? Maybe you have noticed that the introductory quotation stems not from a famous economist, entrepreneur or investor, but from an artist. Company valuation is more art than science.', 'Arts and Applied', '2021-06-13 15:29:55.600000', '2021-06-13 15:29:55.600000'),
(164, 'The Art Of Thinking In Systems', 'Steven Schuster', 'The Art Of Thinking In Systems.png', 0x54686520417274204f66205468696e6b696e6720496e2053797374656d732e706466, '625.00', 'Would you like to think more complexly? Understand why certain things happen to you sometimes seemingly by chance, sometime seemingly by law? Or to become more productive finding shortcuts where no one else is looking? What about improving your relationships understanding why certain arguments truly arise? What would you think if I told you that you can achieve these things by working smarter, not harder? I’ve yet to meet a person who wouldn’t say “Sign me up!” I, too, want all of those things for my life. I’m here to show you how it just might be possible with a shift in your thinking. A paradigm shift in the way you think about the world to systems thinking.', 'Arts and Applied', '2021-06-13 15:31:09.913000', '2021-06-13 15:31:09.913000'),
(165, 'The Personal MBA: Master the Art of Business ', 'Josh Kaufman', 'The Personal MBA_ Master the Art of Business ( PDFDrive ).png', 0x54686520506572736f6e616c204d42415f204d61737465722074686520417274206f6620427573696e657373202820504446447269766520292e706466, '899.99', 'If you’re an entrepreneur, designer, student, programmer, or professional who wants to master the fundamentals of sound business practice, this book is for you. No matter who you are or what you’re trying to do, you’re about to discover a useful new way of looking at business that will help you spend less time fighting your fears and more time doing things that make a difference.', 'Arts and Applied', '2021-06-13 15:33:22.235000', '2021-06-13 15:33:22.235000'),
(166, 'Total Fluidity', 'Zaha Hadid and Patrik Schumacher', 'Total Fluidity.png', 0x546f74616c20666c756964697479205f2053747564696f205a6168612048616469642070726f6a6563747320323030302d323031302c20556e6976657273697479206f66204170706c6965642041727473205669656e6e61202820504446447269766520292e706466, '1500.00', 'Total Fluidity is the slogan that most succinctly describes the objectives and the character of the work of Zaha Hadid Architects.', 'Arts and Applied', '2021-06-13 15:34:47.796000', '2021-06-13 15:34:47.796000');
